INSERT INTO `ps_cms_lang` VALUES (1,2,1,'Dostawa','','Our terms and conditions of delivery','conditions, delivery, delay, shipment, pack','<h2 style=\"margin-bottom:5px;margin-top:0px;font-weight:400;line-height:46.2px;font-size:42px;font-family:\'Gilda Display\', sans-serif;color:#3c3c3d;letter-spacing:-1.68px;background-color:#ffffff;\">Metody dostawy</h2>\n<p style=\"margin-bottom:1rem;margin-top:0px;color:#303030;font-family:Karla, sans-serif;font-size:16px;font-weight:300;background-color:#ffffff;\">Przesyłki nadajemy codziennie w dni robocze (od poniedziałku do piątku), za pośrednictwem Poczty Polskiej i firm kurierskich DPD i Inpost.</p>\n<p style=\"margin-bottom:1rem;margin-top:0px;color:#303030;font-family:Karla, sans-serif;font-size:16px;font-weight:300;background-color:#ffffff;\">- Dla zamówień złożonych do godziny 12.00 możliwa jest wysyłka kurierem DPD i Inpost jeszcze tego samego dnia (dotyczy zamówień realizowanych za pobraniem lub opłaconych do wymienionej godziny).</p>\n<p style=\"margin-bottom:1rem;margin-top:0px;color:#303030;font-family:Karla, sans-serif;font-size:16px;font-weight:300;background-color:#ffffff;\">- Dla zamówień złożonych do godziny 14.00 możliwa jest wysyłka Pocztą Polską również w tym samym dniu (dotyczy zamówień realizowanych za pobraniem lub opłaconych do wymienionej godziny).</p>\n<p style=\"margin-bottom:1rem;margin-top:0px;color:#303030;font-family:Karla, sans-serif;font-size:16px;font-weight:300;background-color:#ffffff;\">Zamówienia realizowane są w kolejności ich składania. W przypadku dużej liczby realizowanych zamówień lub złożeniem zamówienia tuż przed podanymi powyżej godzinami, zamówienie może być nadane dnia następnego. Wszystkie kwestie dotyczące wysyłki zamówień reguluje regulamin sklepu.</p>\n<h2 style=\"margin-bottom:5px;margin-top:0px;font-weight:400;line-height:46.2px;font-size:42px;font-family:\'Gilda Display\', sans-serif;color:#3c3c3d;letter-spacing:-1.68px;background-color:#ffffff;\">Koszty pakowania i wysyłki</h2>\n<p style=\"margin-bottom:1rem;margin-top:0px;color:#303030;font-family:Karla, sans-serif;font-size:16px;font-weight:300;background-color:#ffffff;\">Koszt dostawy uzależniony jest od wyboru przewoźnika, rodzaju przesyłki i ostatecznej jej wagi. Dla wysyłek realizowanych na terytorium Polski obliczany jest automatycznie podczas składania zamówienia. Klient ma możliwość dokonania wyboru przewoźnika jak również rodzaju przesyłki.<span style=\"color:#d0121a;\"><span style=\"font-weight:800;\"> Dla zamówień powyżej 300 złotych wysyłka odbywa się na nasz koszt. </span></span>Wszystkie oferowane przez nasz sposoby dostawy i ich koszty zawarte zostały w tabeli zamieszczonej poniżej. Podane ceny pakowania i wysyłki są cenami brutto i zawierają podatek VAT. Przesyłkę z zamówieniem możemy wysłać również poza granice Polski. Koszt takiej wysyłki ustalany jest indywidualnie z osobami zainteresowanymi.</p>\n<div class=\"table-responsive\" style=\"width:1221px;color:#303030;font-family:Karla, sans-serif;font-size:16px;font-weight:300;background-color:#ffffff;\">\n<table class=\"table table-bordered table-striped\" style=\"border-collapse:collapse;margin-bottom:10px;width:1221px;border:0px;\">\n<thead>\n<tr>\n<th scope=\"col\" style=\"border-width:1px 1px 2px;border-style:solid;border-color:#dddddd;padding:0.75rem;vertical-align:bottom;\">Przesyłka</th>\n<th scope=\"col\" style=\"border-width:1px 1px 2px;border-style:solid;border-color:#dddddd;padding:0.75rem;vertical-align:bottom;\">Waga</th>\n<th scope=\"col\" style=\"border-width:1px 1px 2px;border-style:solid;border-color:#dddddd;padding:0.75rem;vertical-align:bottom;\">Koszt</th>\n</tr>\n</thead>\n<tbody>\n<tr style=\"background-color:rgba(0,0,0,0.05);\">\n<th scope=\"col\" style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">Kurier DPD</th>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">od 0 do 30 Kg</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">17,00 PLN</td>\n</tr>\n<tr>\n<th scope=\"col\" style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">Kurier DPD (pobranie)</th>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">od 0 do 30 Kg</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">23,00 PLN</td>\n</tr>\n<tr style=\"background-color:rgba(0,0,0,0.05);\">\n<th scope=\"col\" style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">Pocztex kurier 48 Standard</th>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">od 0 do 30 Kg</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">15,00 PLN</td>\n</tr>\n<tr>\n<th scope=\"col\" style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">Pocztex kurier 48 Pobranie</th>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">od 0 do 30 Kg</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">21,00 PLN</td>\n</tr>\n<tr style=\"background-color:rgba(0,0,0,0.05);\">\n<th scope=\"col\" style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">Inpost Paczkomaty 24/7</th>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">od 0 do 25 Kg</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">12,99 PLN</td>\n</tr>\n</tbody>\n</table>\n</div>','dostawa'),(2,2,1,'Regulamin','','Legal notice','notice, legal, credits','<p class=\"text-center w-100\" style=\"margin-bottom:1rem;margin-top:0px;width:1440px;text-align:center;\"><img src=\"https://www.sklep.magiakamieni.pl/img/cms/PP_header.jpg\" alt=\"Dbamy o prawa Konsumenta\" style=\"border-style:none;vertical-align:middle;height:auto;\" /></p>\n<h2 class=\"text-center\" style=\"margin-bottom:5px;margin-top:0px;font-weight:400;line-height:46.2px;font-size:42px;font-family:\'Gilda Display\', sans-serif;color:#3c3c3d;letter-spacing:-1.68px;text-align:center;\"><span style=\"font-weight:800;\">REGULAMIN SKLEPU INTERNETOWEGO</span></h2>\n<h2 class=\"text-center\" style=\"margin-bottom:5px;margin-top:0px;font-weight:400;line-height:46.2px;font-size:42px;font-family:\'Gilda Display\', sans-serif;color:#3c3c3d;letter-spacing:-1.68px;text-align:center;\"><span style=\"font-weight:800;\">SKLEP.MAGIAKAMIENI.PL</span></h2>\n<p style=\"margin-bottom:1rem;margin-top:0px;\"></p>\n<h3 style=\"margin-bottom:5px;margin-top:0px;font-weight:500;line-height:normal;font-size:36px;color:#3c3c3d;letter-spacing:-1.44px;\"><span style=\"font-weight:800;\">SPIS TREŚCI:</span></h3>\n<ol style=\"margin-bottom:1rem;margin-top:0px;list-style-position:inside;padding-left:0.75rem;\">\n<li>POSTANOWIENIA OGÓLNE</li>\n<li>USŁUGI ELEKTRONICZNE W SKLEPIE INTERNETOWYM</li>\n<li>WARUNKI ZAWIERANIA UMOWY SPRZEDAŻY</li>\n<li>SPOSOBY I TERMINY PŁATNOŚCI ZA PRODUKT</li>\n<li>KOSZT, SPOSOBY I TERMIN DOSTAWY ORAZ ODBIORU PRODUKTU</li>\n<li>PROCEDURA ROZPATRYWANIA REKLAMACJI</li>\n<li>POZASĄDOWE SPOSOBY ROZPATRYWANIA REKLAMACJI I DOCHODZENIA ROSZCZEŃ ORAZ ZASADY DOSTĘPU DO TYCH PROCEDUR</li>\n<li>PRAWO ODSTĄPIENIA OD UMOWY</li>\n<li>POSTANOWIENIA DOTYCZĄCE PRZEDSIĘBIORCÓW</li>\n<li>OPINIE O SKLEPIE INTERNETOWYM I PRODUKTACH</li>\n<li>NIELEGALNE TREŚCI I INNE TREŚCI NIEZGODNE Z REGULAMINEM</li>\n<li>POSTANOWIENIA KOŃCOWE</li>\n<li>WZÓR FORMULARZA ODSTĄPIENIA OD UMOWY</li>\n</ol>\n<p style=\"margin-bottom:1rem;margin-top:0px;\"></p>\n<p style=\"margin-bottom:1rem;margin-top:0px;\">Sklep Internetowy www.sklep.magiakamieni.pl dba o prawa konsumenta. Konsument nie może zrzec się praw przyznanych mu w Ustawie o Prawach Konsumenta. Postanowienia umów mniej korzystne dla konsumenta niż postanowienia Ustawy o Prawach Konsumenta są nieważne, a w ich miejsce stosuje się przepisy Ustawy o Prawach Konsumenta. Dlatego też postanowienia niniejszego Regulaminu nie mają na celu wyłączać ani ograniczać jakichkolwiek praw konsumentów przysługujących im na mocy bezwzględnie wiążących przepisów prawa, a wszelkie ewentualne wątpliwości należy tłumaczyć na korzyść konsumenta. W przypadku ewentualnej niezgodności postanowień niniejszego Regulaminu z powyższymi przepisami, pierwszeństwo mają te przepisy i należy je stosować.</p>\n<h3 style=\"margin-bottom:5px;margin-top:0px;font-weight:500;line-height:normal;font-size:36px;color:#3c3c3d;letter-spacing:-1.44px;\">1. POSTANOWIENIA OGÓLNE</h3>\n<ul style=\"margin-bottom:1rem;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">1.1.</span>Sklep Internetowy dostępny pod adresem internetowym www.sklep.magiakamieni.pl prowadzony jest przez Annę Janus prowadzącą działalność gospodarczą pod firmą MAGIA KAMIENI ANNA JANUS wpisaną do Centralnej Ewidencji i Informacji o Działalności Gospodarczej Rzeczypospolitej Polskiej prowadzonej przez ministra właściwego do spraw gospodarki, posiadającą: adres miejsca wykonywania działalności i adres do doręczeń: ul. Krakowska 51A, 32-566 Alwernia, NIP 6581864098, REGON 123234441, adres poczty elektronicznej: sklep@magiakamieni.pl, numer telefonu: 12 2580715.</li>\n<li><span style=\"font-weight:800;\">1.2.</span> Niniejszy Regulamin skierowany jest zarówno do konsumentów, jak i do przedsiębiorców korzystających ze Sklepu Internetowego, chyba że dane postanowienie Regulaminu stanowi inaczej.</li>\n<li><span style=\"font-weight:800;\">1.3.</span> Administratorem danych osobowych przetwarzanych w Sklepie Internetowym w związku z realizacją postanowień niniejszego Regulaminu jest Sprzedawca. Dane osobowe przetwarzane są w celach, w zakresie i w oparciu o podstawy i zasady wskazane w <a href=\"https://sklep.magiakamieni.pl/content/6-polityka-prywatnosci\" style=\"background-color:transparent;color:#303030;\"><span style=\"font-weight:800;\">polityce prywatności</span> opublikowanej na stronie Sklepu Internetowego</a>. Polityka prywatności zawiera przede wszystkim zasady dotyczące przetwarzania danych osobowych przez Administratora w Sklepie Internetowym, w tym podstawy, cele i zakres przetwarzania danych osobowych oraz prawa osób, których dane dotyczą, a także informacje w zakresie stosowania w Sklepie Internetowym plików cookies oraz narzędzi analitycznych. Korzystanie ze Sklepu Internetowego, w tym dokonywanie zakupów jest dobrowolne. Podobnie związane z tym podanie danych osobowych przez korzystającego ze Sklepu Internetowego Usługobiorcę lub Klienta jest dobrowolne, z zastrzeżeniem wyjątków wskazanych w polityce prywatności (zawarcie umowy oraz obowiązki ustawowe Sprzedawcy).</li>\n<li><span style=\"font-weight:800;\">1.4.</span> Definicje:\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">1.4.1.</span> AKT O USŁUGACH CYFROWYCH, AKT - rozporządzenie Parlamentu Europejskiego i Rady (UE) 2022/2065 z dnia 19 października 2022 r. w sprawie jednolitego rynku usług cyfrowych oraz zmiany dyrektywy 2000/31/WE (akt o usługach cyfrowych)(Dz.U. L 277 z 27.10.2022, s. 1–102).</li>\n<li><span style=\"font-weight:800;\">1.4.2.</span> CHAT – Usługa Elektroniczna, interaktywny formularz dostępny w Sklepie Internetowy umożliwiający bezpośredni kontakt z Usługodawcą.</li>\n<li><span style=\"font-weight:800;\">1.4.3.</span> DZIEŃ ROBOCZY – jeden dzień od poniedziałku do piątku z wyłączeniem dni ustawowo wolnych od pracy.</li>\n<li><span style=\"font-weight:800;\">1.4.4.</span>FORMULARZ KONTAKTOWY – Usługa Elektroniczna, interaktywny formularz dostępny w Sklepie Internetowym umożliwiający bezpośredni kontakt z Usługodawcą.</li>\n<li><span style=\"font-weight:800;\">1.4.5.</span> FORMULARZ REJESTRACJI – formularz dostępny w Sklepie Internetowym umożliwiający utworzenie Konta.</li>\n<li><span style=\"font-weight:800;\">1.4.6.</span> FORMULARZ ZAMÓWIENIA – Usługa Elektroniczna, interaktywny formularz dostępny w Sklepie Internetowym umożliwiający złożenie Zamówienia, w szczególności poprzez dodanie Produktów do elektronicznego koszyka oraz określenie warunków Umowy Sprzedaży, w tym sposobu dostawy i płatności.</li>\n<li><span style=\"font-weight:800;\">1.4.7.</span> KLIENT – (1) osoba fizyczna posiadająca pełną zdolność do czynności prawnych, a w wypadkach przewidzianych przez przepisy powszechnie obowiązujące także osoba fizyczna posiadająca ograniczoną zdolność do czynności prawnych; (2) osoba prawna; albo (3) jednostka organizacyjna nieposiadająca osobowości prawnej, której ustawa przyznaje zdolność prawną; - która zawarła lub zamierza zawrzeć Umowę Sprzedaży ze Sprzedawcą.</li>\n<li><span style=\"font-weight:800;\">1.4.8.</span> KODEKS CYWILNY – ustawa kodeks cywilny z dnia 23 kwietnia 1964 r. (Dz.U. 1964 nr 16, poz. 93 ze zm.).</li>\n<li><span style=\"font-weight:800;\">1.4.9.</span> KONTO – Usługa Elektroniczna, oznaczony indywidualną nazwą (loginem) i hasłem podanym przez Usługobiorcę zbiór zasobów w systemie teleinformatycznym Usługodawcy, w którym gromadzone są dane podane przez Usługobiorcę oraz informacje o złożonych przez niego Zamówieniach w Sklepie Internetowym.</li>\n<li><span style=\"font-weight:800;\">1.4.10.</span> NEWSLETTER – Usługa Elektroniczna, elektroniczna usługa dystrybucyjna świadczona przez Usługodawcę za pośrednictwem poczty elektronicznej e-mail, która umożliwia wszystkim korzystającym z niej Usługobiorcom automatyczne otrzymywanie od Usługodawcy cyklicznych treści kolejnych edycji newslettera zawierającego informacje o Produktach, nowościach i promocjach w Sklepie Internetowym.</li>\n<li><span style=\"font-weight:800;\">1.4.11.</span> NIELEGALNE TREŚCI - informacje, które same w sobie lub przez odniesienie do działania, w tym sprzedaży Produktów lub świadczenia Usług Elektronicznych, nie są zgodne z prawem Unii Europejskiej lub z prawem jakiegokolwiek państwa członkowskiego, które jest zgodne z prawem Unii Europejskiej, niezależnie od konkretnego przedmiotu lub charakteru tego prawa.</li>\n<li><span style=\"font-weight:800;\">1.4.12. </span>PRODUKT – dostępna w Sklepie Internetowym (1) rzecz ruchoma (w tym rzecz ruchoma z elementami cyfrowymi, tj. zawierająca treść cyfrową lub usługę cyfrową lub z nimi połączona w taki sposób, że brak treści cyfrowej lub usługi cyfrowej uniemożliwiłby jej prawidłowe funkcjonowanie) będąca przedmiotem Umowy Sprzedaży między Klientem a Sprzedawcą.</li>\n<li><span style=\"font-weight:800;\">1.4.13. </span>REGULAMIN – niniejszy regulamin Sklepu Internetowego.</li>\n<li><span style=\"font-weight:800;\">1.4.14.</span> SKLEP INTERNETOWY - sklep internetowy Usługodawcy dostępny pod adresem internetowym: www.sklep.magiakamieni.pl.</li>\n<li><span style=\"font-weight:800;\">1.4.15.</span> SPRZEDAWCA; USŁUGODAWCA – Anna Janus prowadząca działalność gospodarczą pod firmą MAGIA KAMIENI ANNA JANUS wpisana do Centralnej Ewidencji i Informacji o Działalności Gospodarczej Rzeczypospolitej Polskiej prowadzonej przez ministra właściwego do spraw gospodarki, posiadająca: adres miejsca wykonywania działalności i <span>adres do doręczeń</span>: ul. Krakowska 51A, 32-566 Alwernia, NIP 6581864098, REGON 123234441, adres poczty elektronicznej: sklep@magiakamieni.pl.</li>\n<li><span style=\"font-weight:800;\">1.4.16.</span> UMOWA SPRZEDAŻY – (1) umowa sprzedaży Produktu (w przypadku rzeczy ruchomych oraz rzeczy ruchomych z elementami cyfrowymi), (2) umowa o dostarczanie Produktu (w przypadku treści cyfrowej lub usługi cyfrowej), (3) umowa o świadczenie lub korzystanie z Produktu (w przypadku usługi innej niż cyfrowa oraz pozostałych Produktów) zawierana albo zawarta między Klientem a Sprzedawcą za pośrednictwem Sklepu Internetowego.</li>\n<li><span style=\"font-weight:800;\">1.4.17. </span>USŁUGA ELEKTRONICZNA – usługa świadczona drogą elektroniczną przez Usługodawcę na rzecz Usługobiorcy za pośrednictwem Sklepu Internetowego.</li>\n<li><span style=\"font-weight:800;\">1.4.18. </span>USŁUGOBIORCA – (1) osoba fizyczna posiadająca pełną zdolność do czynności prawnych, a w wypadkach przewidzianych przez przepisy powszechnie obowiązujące także osoba fizyczna posiadająca ograniczoną zdolność do czynności prawnych; (2) osoba prawna; albo (3) jednostka organizacyjna nieposiadająca osobowości prawnej, której ustawa przyznaje zdolność prawną; - korzystająca lub zamierzająca korzystać z Usługi Elektronicznej.</li>\n<li><span style=\"font-weight:800;\">1.4.19. </span>USTAWA O PRAWACH KONSUMENTA – ustawa z dnia 30 maja 2014 r. o prawach konsumenta (Dz.U. 2014 poz. 827 ze zm.).</li>\n<li><span style=\"font-weight:800;\">1.4.20. </span>ZAMÓWIENIE - oświadczenie woli Klienta składane za pomocą Formularza Zamówienia i zmierzające bezpośrednio do zawarcia Umowy Sprzedaży Produktu ze Sprzedawcą.</li>\n</ul>\n</li>\n</ul>\n<h3 style=\"margin-bottom:5px;margin-top:0px;font-weight:500;line-height:normal;font-size:36px;color:#3c3c3d;letter-spacing:-1.44px;\">2. USŁUGI ELEKTRONICZNE W SKLEPIE INTERNETOWYM</h3>\n<ul style=\"margin-bottom:1rem;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">2.1. </span>W Sklepie Internetowym dostępne są następujące Usługi Elektroniczne: Chat, Formularz Kontaktowy, Konto, Formularz Zamówienia, Newsletter oraz System Opinii o Sklepie.\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">2.1.1. </span>Chat - korzystanie z Chatu możliwe jest po wykonaniu łącznie siedmiu kolejnych kroków przez Usługobiorcę - (1) kliknięciu pola przedstawiającego dymek wiadomości, (2) wpisaniu treści wiadomości, (3) kliknięciu pola akcji na klawiaturze, (4) wypełnieniu formularza, (5) kliknięciu pola <span style=\"font-weight:800;\">„Wyślij wiadomość”</span>, (6) wpisaniu treści wiadomości; oraz (7) kliknięciu pola akcji na klawiaturze. W formularzu niezbędne jest podanie przez Usługobiorcę następujących danych: imię oraz adres poczty elektronicznej.\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">2.1.1.1 </span>Po skorzystaniu z Chatu możliwe jest uzyskanie transkrypcji. Uzyskanie transkrypcji wymaga wykonania łącznie dwóch kolejnych kroków przez Usługobiorcę - (1) kliknięciu symbolu przedstawiającego trzy kropki ustawione jedna pod drugą, (2) kliknięciu pola <span style=\"font-weight:800;\">„Pobierz transkrypt\"</span>.</li>\n<li><span style=\"font-weight:800;\">2.1.1.2 </span>Usługa Elektroniczna Chat świadczona jest nieodpłatnie oraz ma charakter jednorazowy i ulega zakończeniu z chwilą zakończenia prowadzenia rozmowy przez Usługobiorcę i Usługodawcę za jego pośrednictwem albo z chwilą wcześniejszego zaprzestania składania zapytania za jego pośrednictwem przez Usługobiorcę lub Usługodawcę.</li>\n</ul>\n</li>\n</ul>\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">2.1.2.</span> Formularz Kontaktowy – korzystanie z Formularza Kontaktowego rozpoczyna się po wykonaniu przez Usługobiorcę łącznie dwóch kolejnych kroków – (1) przejścia do zakładki „Kontakt” i (2) kliknięciu na stronie Sklepu Internetowego po wypełnieniu Formularza Kontaktowego pole <span style=\"font-weight:800;\">„Wyślij”</span>. W Formularzu Kontaktowym niezbędne jest podanie przez Usługobiorcę następujących danych: adres poczty elektronicznej oraz wpisanie treści zapytania.\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">2.1.2.1 </span>Usługa Formularza Kontaktowego świadczona jest nieodpłatnie oraz ma charakter jednorazowy i ulega zakończeniu z chwilą przesłania zapytania.</li>\n</ul>\n</li>\n<li><span style=\"font-weight:800;\">2.1.3. </span>Konto – korzystanie z Konta możliwe jest po wykonaniu łącznie dwóch kolejnych kroków przez Usługobiorcę – (1) wypełnieniu Formularza Rejestracji, (2) kliknięciu pola „<span style=\"font-weight:800;\">Zarejestruj się</span>”. W Formularzu Rejestracji niezbędne jest podanie przez Usługobiorcę następujących danych Usługobiorcy: imię i nazwisko, adres poczty elektronicznej oraz hasło. Konto można również założyć w trakcie składania Zamówienia, poprzez zaznaczenie właściwego checkboxa w Formularzu Zamówienia – z chwilą złożenia Zamówienia, Usługobiorcy zostaje założone Konto.\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">2.1.3.1.</span> Usługa Elektroniczna Konto świadczona jest nieodpłatnie przez czas nieoznaczony. Usługobiorca ma możliwość, w każdej chwili i bez podania przyczyny, usunięcia Konta (rezygnacji z Konta) poprzez wysłanie stosownego żądania do Usługodawcy, w szczególności za pośrednictwem poczty elektronicznej na adres: sklep@magiakamieni.pl lub też pisemnie na adres: ul. Krakowska 51A, 32-566 Alwernia.</li>\n</ul>\n</li>\n<li><span style=\"font-weight:800;\">2.1.4. </span>Formularz Zamówienia – korzystanie z Formularza Zamówienia rozpoczyna się z momentem dodania przez Klienta pierwszego Produktu do elektronicznego koszyka w Sklepie Internetowym. Złożenie Zamówienia następuje po wykonaniu przez Klienta łącznie dwóch kolejnych kroków – (1) po wypełnieniu Formularza Zamówienia i (2) kliknięciu na stronie Sklepu Internetowego po wypełnieniu Formularza Zamówienia pola „<span style=\"font-weight:800;\">Składam zamówienie z obowiązkiem zapłaty</span>” – do tego momentu istnieje możliwość samodzielnej modyfikacji wprowadzanych danych (w tym celu należy kierować się wyświetlanymi komunikatami oraz informacjami dostępnymi na stronie Sklepu Internetowego). W Formularzu Zamówienia niezbędne jest podanie przez Klienta następujących danych dotyczących Klienta: imię, nazwisko, adres (ulica, numer domu/mieszkania, kod pocztowy, miejscowość, kraj), adres poczty elektronicznej, numer telefonu kontaktowego oraz danych dotyczących Umowy Sprzedaży: Produkt/y, ilość Produktu/ów, miejsce i sposób dostawy Produktu/ów, sposób płatności. W wypadku Klientów niebędących konsumentami niezbędne jest także podanie nazwy firmy oraz numeru NIP.\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">2.1.4.1.</span> Usługa Elektroniczna Formularz Zamówienia świadczona jest nieodpłatnie oraz ma charakter jednorazowy i ulega zakończeniu z chwilą złożenia Zamówienia za jego pośrednictwem albo z chwilą wcześniejszego zaprzestania składania Zamówienia za jego pośrednictwem przez Usługobiorcę.</li>\n</ul>\n</li>\n<li><span style=\"font-weight:800;\">2.1.5.</span> Newsletter – korzystanie z Newslettera możliwe jest poprzez - (1) zaznaczenie odpowiedniego checkboxa w trakcie zakładania Konta – z chwilą utworzenia Konta Usługobiorca zostaje zapisany na Newsletter, (2) zaznaczenie odpowiedniego checkboxa w ustawieniach Konta – z chwilą kliknięcia pola „<span style=\"font-weight:800;\">Zapisz</span>” Usługobiorca zostaje zapisany na Newsletter, (3) zaznaczenie odpowiedniego checkboxa w trakcie składania Zamówienia za pośrednictwem Formularza Zamówienia – z chwilą złożenia Zamówienia Usługobiorca zostaje zapisany na Newsletter, (4) podanie w formularzu na stronie domowej Sklepu Internetowego w polu „Newsletter” adresu poczty elektronicznej i kliknięciu pola „<span style=\"font-weight:800;\">ZAPISZ</span>” - z chwilą kliknięcia pola „ZAPISZ” Usługobiorca zostaje zapisany na Newsletter.\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">2.1.5.1.</span> 1.1.23.1. Usługa Elektroniczna Newsletter świadczona jest nieodpłatnie przez czas nieoznaczony. Usługobiorca ma możliwość, w każdej chwili i bez podania przyczyny, wypisania się z Newslettera (rezygnacji z Newslettera) poprzez (1) wysłanie stosownego żądania do Usługodawcy, w szczególności za pośrednictwem poczty elektronicznej na adres: sklep@magiakamieni.pl lub też pisemnie na adres: ul. Krakowska 51A, 32-566 Alwernia, (2) zaznaczenie odpowiedniego checkboxa w ustawieniach Konta – z chwilą kliknięcia pola „Zapisz” Usługobiorca zostaje wypisany z Newslettera.</li>\n</ul>\n</li>\n<li><span style=\"font-weight:800;\">2.1.6.</span> Oceny w sklepie internetowym.\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">2.1.6.1.</span>Klient Sklepu Internetowego ma możliwość dobrowolnego i nieodpłatnego wystawienia opinii dotyczącej zakupów dokonanych w Sklepie Internetowym. Przedmiotem opinii może być także ocena, zdjęcie lub recenzja zakupionego produktu w Sklepie Internetowym. Sprzedawca po dokonanych zakupach w Sklepie Internetowym wysyła do Klienta wiadomość email z prośbą o wystawienie opinii oraz linkiem do formularza online umożliwiającego jej wystawienie – formularz online umożliwia udzielenie odpowiedzi na pytania Sprzedawcy dotyczące zakupów, ich ocenę, dodanie własnego opisu dot. opinii oraz zdjęcia zakupionego produktu. W razie braku wystawienia opinii po otrzymaniu pierwszego zaproszenia do wystawienia opinii Sprzedawca ponawia wysyłkę zaproszenia.</li>\n<li><span style=\"font-weight:800;\">2.1.6.2.</span>Opinia może być wystawiona jedynie przez Klienta, który dokonał zakupów w Sklepie Internetowym Sprzedawcy. Wystawione przez Klienta opinie są publikowane przez Sprzedawcę w Sklepie Internetowym oraz wizytówce TrustMate.io.</li>\n<li><span style=\"font-weight:800;\">2.1.6.3.</span> Wystawienie opinii nie może być wykorzystywane przez Klienta do działań bezprawnych, w szczególności do działań stanowiących czyn nieuczciwej konkurencji wobec Sprzedawcy, czy też działań naruszających dobra osobiste, prawa własności intelektualnej lub inne prawa Sprzedawcy lub osób trzecich.</li>\n<li><span style=\"font-weight:800;\">2.1.6.4.</span> Opinia może być wystawiona tylko do faktycznie zakupionych produktów w Sklepie Internetowym Sprzedawcy. Zabronione jest zawieranie fikcyjnych/pozornych umów sprzedaży w celu wystawienia opinii. Autorem opinii nie może być także sam Sprzedawca ani jego pracownicy bez względu na podstawę zatrudnienia.</li>\n<li><span style=\"font-weight:800;\">2.1.6.5.</span> Wystawiona opinia może zostać w każdym czasie usunięta przez jej autora.</li>\n</ul>\n</li>\n</ul>\n</li>\n<li><span style=\"font-weight:800;\">2.2.</span> Wymagania techniczne niezbędne do współpracy z systemem teleinformatycznym, którym posługuje się Usługodawca: (1) komputer, laptop lub inne urządzenie multimedialne z dostępem do Internetu; (2) dostęp do poczty elektronicznej; (3) przeglądarka internetowa: Mozilla Firefox w wersji 17.0 i wyższej lub Internet Explorer w wersji 10.0 i wyższej, Opera w wersji 12.0 i wyższej, Google Chrome w wersji 23.0. i wyższej, Safari w wersji 5.0 i wyższej, Microsoft Edge w wersji 25.10586.0.0 i wyższej; (4) włączenie w przeglądarce internetowej możliwości zapisu plików Cookies oraz obsługi Javascript.</li>\n<li><span style=\"font-weight:800;\">2.3.</span> Usługobiorca obowiązany jest do korzystania ze Sklepu Internetowego w sposób zgodny z prawem i dobrymi obyczajami mając na uwadze poszanowanie dóbr osobistych oraz praw autorskich i własności intelektualnej Usługodawcy oraz osób trzecich. Usługobiorca obowiązany jest do wprowadzania danych zgodnych ze stanem faktycznym. Usługobiorcę obowiązuje zakaz dostarczania treści o charakterze bezprawnym.</li>\n<li><span style=\"font-weight:800;\">2.4. </span>Tryb postępowania reklamacyjnego dotyczący Usług Elektronicznych wskazany jest w pkt. 6. Regulaminu.</li>\n</ul>\n<h3 style=\"margin-bottom:5px;margin-top:0px;font-weight:500;line-height:normal;font-size:36px;color:#3c3c3d;letter-spacing:-1.44px;\">3. WARUNKI ZAWIERANIA UMOWY SPRZEDAŻY</h3>\n<ul style=\"margin-bottom:1rem;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">3.1.</span> Zawarcie Umowy Sprzedaży między Klientem, a Sprzedawcą następuje po uprzednim złożeniu przez Klienta Zamówienia za pomocą Formularza Zamówień w Sklepie Internetowym zgodnie z pkt. 2.1.4 Regulaminu.</li>\n<li><span style=\"font-weight:800;\">3.2.</span> Cena Produktu lub wynagrodzenie za Produkt uwidoczniona na stronie Sklepu Internetowego podane jest w złotych polskich i zawiera podatki. O łącznej cenie lub wynagrodzeniu wraz z podatkami, a gdy charakter Produktu nie pozwala, rozsądnie oceniając, na wcześniejsze obliczenie wysokości – sposobie, w jaki będą one obliczane, a także o kosztach dostawy (w tym opłatach za transport, dostarczenie lub usługi pocztowe) oraz o innych kosztach, a gdy nie można ustalić wysokości tych opłat – o obowiązku ich uiszczenia, Klient jest informowany na stronach Sklepu Internetowego, w tym także w trakcie składania Zamówienia oraz w chwili wyrażenia przez Klienta woli związania się Umową Sprzedaży. W razie Umowy Sprzedaży Produktu zawieranej na czas nieoznaczony lub obejmującej prenumeratę Sprzedawca podaje w ten sam sposób łączną cenę lub wynagrodzenie obejmujące wszystkie płatności za okres rozliczeniowy, a gdy Umowa Sprzedaży przewiduje stałą stawkę - także łączne miesięczne płatności.</li>\n<li><span style=\"font-weight:800;\">3.3.</span> Procedura zawarcia Umowy Sprzedaży w Sklepie Internetowym za pomocą Formularza Zamówienia.\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">3.3.1.</span> Zawarcie Umowy Sprzedaży między Klientem, a Sprzedawcą następuje po uprzednim złożeniu przez Klienta Zamówienia w Sklepie Internetowym zgodnie z pkt. 2.1.4 Regulaminu.</li>\n<li><span style=\"font-weight:800;\">3.3.2.</span> Po złożeniu Zamówienia Sprzedawca niezwłocznie potwierdza jego otrzymanie oraz jednocześnie przyjmuje Zamówienie do realizacji. Potwierdzenie otrzymania Zamówienia i jego przyjęcie do realizacji następuje poprzez przesłanie przez Sprzedawcę Klientowi stosownej wiadomości e-mail na podany w trakcie składania Zamówienia adres poczty elektronicznej Klienta, która zawiera co najmniej oświadczenia Sprzedawcy o otrzymaniu Zamówienia i o jego przyjęciu do realizacji oraz potwierdzenie zawarcia Umowy Sprzedaży. Z chwilą otrzymania przez Klienta powyższej wiadomości e-mail zostaje zawarta Umowa Sprzedaży między Klientem, a Sprzedawcą.</li>\n</ul>\n</li>\n<li><span style=\"font-weight:800;\">3.4.</span> Utrwalenie, zabezpieczenie oraz udostępnienie Klientowi treści zawieranej Umowy Sprzedaży następuje poprzez (1) udostępnienie niniejszego Regulaminu na stronie Sklepu Internetowego oraz (2) przesłanie Klientowi wiadomości e-mail, o której mowa w pkt. 3.3.2. Regulaminu. Treść Umowy Sprzedaży jest dodatkowo utrwalona i zabezpieczona w systemie informatycznym Sklepu Internetowego Sprzedawcy.</li>\n</ul>\n<h3 style=\"margin-bottom:5px;margin-top:0px;font-weight:500;line-height:normal;font-size:36px;color:#3c3c3d;letter-spacing:-1.44px;\">4. SPOSOBY I TERMINY PŁATNOŚCI ZA PRODUKT</h3>\n<ul style=\"margin-bottom:1rem;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">4.1. </span>Sprzedawca udostępnia Klientowi następujące sposoby płatności z tytułu Umowy Sprzedaży:\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">4.1.1.</span> Płatność gotówką za pobraniem przy odbiorze przesyłki.</li>\n<li><span style=\"font-weight:800;\">4.1.2.</span> Płatność gotówką lub kartą płatniczą przy odbiorze osobistym.</li>\n<li><span style=\"font-weight:800;\">4.1.3.</span> Płatność przelewem na rachunek bankowy Sprzedawcy.</li>\n<li><span style=\"font-weight:800;\">4.1.4. </span>Płatności elektroniczne i płatności kartą płatniczą za pośrednictwem serwisu PayPal.com, Dotpay.pl – możliwe aktualne sposoby płatności określone są na stronie Sklepu Internetowego w zakładce informacyjnej dotyczącej sposobów płatności oraz na stronie internetowej https://www.paypal.com/pl, http://www.dotpay.pl/.\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li>\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">4.1.4.1. </span>Rozliczenia transakcji płatnościami elektronicznymi i kartą płatniczą przeprowadzane są zgodnie z wyborem Klienta za pośrednictwem serwisu PayPal.com lub Dotpay.pl. Obsługę płatności elektronicznych i kartą płatniczą prowadzi:\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li>\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">4.1.4.1.1. </span>PayPal.com – 1.1.29.1.1. PayPal (Europe) S.a r.l. et Cie, S.C.A., 5. kondygnacja 22-24 Boulavard Royal, L-2449 Luksemburg, Wielkie Księstwo Luksemburga, Numer w rejestrze handlowym: R.C.S. Luxembourg B 118 349, Numer VAT: LU22046007.</li>\n<li><span style=\"font-weight:800;\">4.1.4.1.2. </span>Dotpay.pl – 1.1.29.1.2. spółka PAYPRO SPÓŁKA AKCYJNA z siedzibą w Poznaniu (adres siedziby: ul. Pastelowa 8, 60-198 Poznań), wpisana do Rejestru Przedsiębiorców Krajowego Rejestru Sądowego pod numerem 0000347935, akta rejestrowe przechowywane przez Sąd Rejonowy Poznań – Nowe Miasto i Wilda w Poznaniu VIII Wydział Gospodarczy Krajowego Rejestru Sądowego, kapitał zakładowy w wysokości 5 476.300,00 zł, NIP: 7792369887, REGON: 301345068..</li>\n</ul>\n</li>\n</ul>\n</li>\n</ul>\n</li>\n</ul>\n</li>\n</ul>\n</li>\n<li><span style=\"font-weight:800;\">4.2. </span>Termin płatności:\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">4.2.1.</span> W przypadku wyboru przez Klienta płatności przelewem, płatności elektronicznych albo płatności kartą płatniczą, Klient obowiązany jest do dokonania płatności w terminie 7 dni kalendarzowych od dnia zawarcia Umowy Sprzedaży.</li>\n<li><span style=\"font-weight:800;\">4.2.2. </span>W przypadku wyboru przez Klienta płatności gotówką za pobraniem przy odbiorze przesyłki albo płatności gotówką lub kartą płatniczą przy odbiorze osobistym, Klient obowiązany jest do dokonania płatności przy odbiorze przesyłki.</li>\n</ul>\n</li>\n</ul>\n<h3 style=\"margin-bottom:5px;margin-top:0px;font-weight:500;line-height:normal;font-size:36px;color:#3c3c3d;letter-spacing:-1.44px;\">5. KOSZT, SPOSOBY I TERMIN DOSTAWY ORAZ ODBIORU PRODUKTU</h3>\n<ul style=\"margin-bottom:1rem;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">5.1.</span> Dostawa Produktu do Klienta jest odpłatna, chyba że Umowa Sprzedaży stanowi inaczej. Koszty dostawy Produktu (w tym opłaty za transport, dostarczenie i usługi pocztowe) albo, w przypadku dostawy poza granicę Polski, jeżeli nie jest możliwe ustalenie wysokości tych opłat z góry – informacja o obowiązku uiszczenia tych kosztów po zawarciu Umowy Sprzedaży – są wskazywane Klientowi na stronach Sklepu Internetowego w zakładce informacyjnej dotyczącej kosztów dostawy oraz w trakcie składania Zamówienia, w tym także w chwili wyrażenia przez Klienta woli związania się Umową Sprzedaży. W przypadku dostawy poza granicę Polskie, koszty dostawy ustalane są przez Sprzedawcę indywidualnie z Klientem na podstawie wagi przesyłki, jej rodzaju i kraju docelowego. Ustalenia takie dokonywane są za pośrednictwem poczty elektronicznej, niezwłocznie po złożeniu przez Klienta Zamówienia.</li>\n<li><span style=\"font-weight:800;\">5.2.</span> Odbiór osobisty Produktu przez Klienta jest bezpłatny.</li>\n<li><span style=\"font-weight:800;\">5.3.</span> Sprzedawca udostępnia Klientowi następujące sposoby dostawy lub odbioru Produktu:\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">5.3.1. </span>Przesyłka pocztowa, przesyłka pocztowa pobraniowa.</li>\n<li><span style=\"font-weight:800;\">5.3.2.</span> Przesyłka kurierska, przesyłka kurierska pobraniowa.</li>\n<li><span style=\"font-weight:800;\">5.3.3.</span> Przesyłka paletowa.</li>\n<li><span style=\"font-weight:800;\">5.3.4. </span>Transport własny Sprzedawcy.</li>\n<li><span style=\"font-weight:800;\">5.3.5. </span>Odbiór osobisty dostępny pod adresem: ul. Krakowska 51A, 32-566 Alwernia – w Dni Robocze, w godzinach od 07:00 do 15:00.</li>\n</ul>\n</li>\n<li><span style=\"font-weight:800;\">5.4. Termin dostawy Produktu do Klienta</span> wynosi do 10 Dni Roboczych, chyba że w opisie danego Produktu lub w trakcie składania Zamówienia podano krótszy termin. W przypadku Produktów o różnych terminach dostawy, terminem dostawy jest najdłuższy podany termin, który jednak nie może przekroczyć 10 Dni Roboczych. Początek biegu terminu dostawy Produktu do Klienta liczy się w następujący sposób:\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">5.4.1. </span>W przypadku wyboru przez Klienta sposobu płatności przelewem, płatności elektronicznych lub kartą płatniczą - od dnia uznania rachunku bankowego lub rachunku rozliczeniowego Sprzedawcy.</li>\n<li><span style=\"font-weight:800;\">5.4.2. </span>W przypadku wyboru przez Klienta sposobu płatności gotówką za pobraniem – od dnia zawarcia Umowy Sprzedaży.</li>\n</ul>\n</li>\n<li><span style=\"font-weight:800;\">5.5. Termin gotowości Produktu do odbioru przez Klienta</span> – w przypadku wyboru przez Klienta odbioru osobistego Produktu, Produkt będzie gotowy do odbioru przez Klienta w terminie do 1 Dnia Roboczego. O gotowości Produktu do odbioru Klient zostanie dodatkowo poinformowany przez Sprzedawcę. Początek biegu terminu gotowości Produktu do odbioru przez Klienta liczy się w następujący sposób:\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">5.5.1.</span> W przypadku wyboru przez Klienta sposobu płatności przelewem, płatności elektronicznych lub kartą płatniczą - od dnia uznania rachunku bankowego lub rachunku rozliczeniowego Sprzedawcy.</li>\n<li><span style=\"font-weight:800;\">5.5.2. </span>W przypadku wyboru przez Klienta sposobu gotówką lub kartą płatniczą przy odbiorze osobistym – od dnia zawarcia Umowy Sprzedaży.</li>\n</ul>\n</li>\n</ul>\n<h3 style=\"margin-bottom:5px;margin-top:0px;font-weight:500;line-height:normal;font-size:36px;color:#3c3c3d;letter-spacing:-1.44px;\">6. PROCEDURA ROZPATRYWANIA REKLAMACJI</h3>\n<ul style=\"margin-bottom:1rem;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">6.1. </span>Niniejszy punkt 6. Regulaminu określa procedurę rozpatrywania reklamacji wspólną dla wszystkich reklamacji składanych do Sprzedawcy, w szczególności reklamacji dotyczących Produktów, Umów Sprzedaży, Usług Elektronicznych oraz pozostałych reklamacji związanych z działaniem Sprzedawcy lub Sklepu Internetowego.</li>\n<li><span style=\"font-weight:800;\">6.2. </span>Podstawa i zakres odpowiedzialności są określone powszechnie obowiązującymi przepisami prawa, w szczególności w Kodeksie Cywilnym, Ustawie o Prawach Konsumenta oraz ustawie o świadczeniu usług drogą elektroniczną z dnia 18 lipca 2002 r. (Dz.U. Nr 144, poz. 1204 ze zm.).\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">6.2.1. </span>Szczegółowe postanowienia dotyczące reklamacji Produktu – rzeczy ruchomej – zakupionego przez Klienta na podstawie Umowy Sprzedaży zawartej ze Sprzedawcą do dnia 31. grudnia 2022 r. określają przepisy Kodeksu Cywilnego w brzmieniu obowiązującym do dnia 31. grudnia 2022 r., w szczególności art. 556-576 Kodeksu Cywilnego. Przepisy te określają w szczególności podstawę i zakres odpowiedzialności Sprzedawcy względem Klienta, jeżeli sprzedany Produkt ma wadę fizyczną lub prawną (rękojmia). Sprzedawca obowiązany jest dostarczyć Klientowi Produkt bez wad. Zgodnie z art. 558 § 1 Kodeksu Cywilnego odpowiedzialność Sprzedawcy z tytułu rękojmi za Produkt zakupiony zgodnie ze zdaniem poprzednim wobec Klienta niebędącego konsumentem zostaje wyłączona.</li>\n<li><span style=\"font-weight:800;\">6.2.2. </span>Szczegółowe postanowienia dotyczące reklamacji Produktu – rzeczy ruchomej (w tym rzeczy ruchomej z elementami cyfrowymi), z wyłączeniem jednak rzeczy ruchomej, która służy wyłącznie jako nośnik treści cyfrowej – zakupionego przez Klienta na podstawie Umowy Sprzedaży zawartej ze Sprzedawcą od dnia 1. stycznia 2023 r. określają przepisy Ustawy o Prawach Konsumenta w brzmieniu obowiązującym od dnia 1. stycznia 2023 r., w szczególności art. 43a - 43g Ustawy o Prawach Konsumenta. Przepisy te określają w szczególności podstawę i zakres odpowiedzialności Sprzedawcy względem konsumenta, w razie braku zgodności Produktu z Umową Sprzedaży.</li>\n</ul>\n</li>\n<li><span style=\"font-weight:800;\">6.3. </span>Reklamacja może zostać złożona na przykład:\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">6.3.1. </span>pisemnie na adres: ul. Krakowska 51A, 32-566 Alwernia.</li>\n<li><span style=\"font-weight:800;\">6.3.2. </span>w formie elektronicznej za pośrednictwem poczty elektronicznej na adres: sklep@magiakamieni.pl</li>\n</ul>\n</li>\n<li><span style=\"font-weight:800;\">6.4. </span>Przesłanie lub zwrot Produktu w ramach reklamacji może nastąpić na adres: ul. Krakowska 51A, 32-566 Alwernia.</li>\n<li><span style=\"font-weight:800;\">6.5. </span>Zaleca się podanie w opisie reklamacji: (1) informacji i okoliczności dotyczących przedmiotu reklamacji, w szczególności rodzaju i daty wystąpienia nieprawidłowości lub braku zgodności z umową; (2) żądania sposobu doprowadzenia do zgodności z umową lub oświadczenia o obniżeniu ceny albo odstąpieniu od umowy lub innego roszczenia; oraz (3) danych kontaktowych składającego reklamację – ułatwi to i przyspieszy rozpatrzenie reklamacji. Wymogi podane w zdaniu poprzednim mają formę jedynie zalecenia i nie wpływają na skuteczność reklamacji złożonych z pominięciem zalecanego opisu reklamacji.</li>\n<li><span style=\"font-weight:800;\">6.6.</span> W razie zmiany podanych danych kontaktowych przez składającego reklamację w trakcie rozpatrywania reklamacji zobowiązany jest on do powiadomienia o tym Sprzedawcy.</li>\n<li><span style=\"font-weight:800;\">6.7. </span>Do reklamacji mogą zostać załączone przez składającego reklamację dowody (np. zdjęcia, dokumenty lub Produkt) związane z przedmiotem reklamacji. Sprzedawca może także zwrócić się do składającego reklamację z prośbą o podanie dodatkowych informacji lub przesłanie dowodów (np. zdjęcia), jeżeli ułatwi to i przyspieszy rozpatrzenie reklamacji przez Sprzedawcę.</li>\n<li><span style=\"font-weight:800;\">6.8.</span>Sprzedawca ustosunkuje się do reklamacji niezwłocznie, nie później niż w terminie 14 dni kalendarzowych od dnia jej otrzymania.</li>\n<li><span style=\"font-weight:800;\">6.9.</span>Poza odpowiedzialnością ustawową na Produkt może zostać udzielona gwarancja – jest to odpowiedzialność umowna (dodatkowa) i można z niej skorzystać, gdy dany Produkt jest objęty gwarancją. Gwarancja może być udzielona przez inny podmiot niż Sprzedawca (np. przez producenta lub dystrybutora). Szczegółowe warunki dotyczące odpowiedzialności na podstawie gwarancji, w tym także dane podmiotu odpowiedzialnego za realizację gwarancji oraz podmiotu uprawnionego do skorzystania z niej są dostępne w opisie gwarancji, np. w karcie gwarancyjnej lub w innym miejscu dotyczącym udzielenia gwarancji. Sprzedawca wskazuje, że w przypadku braku zgodności Produktu z umową Klientowi z mocy prawa przysługują środki ochrony prawnej ze strony i na koszt Sprzedawcy oraz że gwarancja nie ma wpływu na te środki ochrony prawnej.</li>\n<li><span style=\"font-weight:800;\">6.10.</span>Zawarte w punkcie 6.2.2. Regulaminu postanowienia dotyczące konsumenta stosuje się również do Klienta będącego osobą fizyczną zawierającą umowę bezpośrednio związaną z jej działalnością gospodarczą, gdy z treści tej umowy wynika, że nie posiada ona dla tej osoby charakteru zawodowego, wynikającego w szczególności z przedmiotu wykonywanej przez nią działalności gospodarczej, udostępnionego na podstawie przepisów o Centralnej Ewidencji i Informacji o Działalności Gospodarczej.</li>\n</ul>\n<h3 style=\"margin-bottom:5px;margin-top:0px;font-weight:500;line-height:normal;font-size:36px;color:#3c3c3d;letter-spacing:-1.44px;\">7. POZASĄDOWE SPOSOBY ROZPATRYWANIA REKLAMACJI I DOCHODZENIA ROSZCZEŃ ORAZ ZASADY DOSTĘPU DO TYCH PROCEDUR</h3>\n<ul style=\"margin-bottom:1rem;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">7.1.</span> Metody rozwiązywania sporów bez udziału sądu to między innymi (1) umożliwienie zbliżenia stanowisk stron, np. poprzez mediację; (2) zaproponowanie rozwiązania sporu, np. poprzez koncyliację oraz (3) rozstrzygnięcie sporu i narzucenie stronom jego rozwiązania, np. w ramach arbitrażu (sąd polubowny). Szczegółowe informacje dotyczące możliwości skorzystania przez Klienta będącego konsumentem z pozasądowych sposobów rozpatrywania reklamacji i dochodzenia roszczeń, zasady dostępu do tych procedur oraz przyjazna wyszukiwarka podmiotów zajmujących się polubownym rozwiązywaniem sporów dostępne są na stronie internetowej Urzędu Ochrony Konkurencji i Konsumentów pod adresem: https://polubowne.uokik.gov.pl/<br /><span style=\"font-weight:800;\">7.2.</span> Przy Prezesie Urzędu Ochrony Konkurencji i Konsumentów działa także punkt kontaktowy, którego zadaniem jest między innymi udzielanie konsumentom informacji dotyczących pozasądowego rozwiązywania sporów konsumenckich. Z punktem konsument może się skontaktować: (1) telefonicznie – dzwoniąc pod numer 22 55 60 332 lub 22 55 60 333; (2) za pomocą poczty elektronicznej – przesyłając wiadomość na adres: kontakt.adr@uokik.gov.pl lub (3) pisemnie lub osobiście – w Centrali Urzędu przy placu Powstańców Warszawy 1 w Warszawie (00-030).</li>\n<li><span style=\"font-weight:800;\">7.3.</span> Konsument posiada następujące przykładowe możliwości skorzystania z pozasądowych sposobów rozpatrywania reklamacji i dochodzenia roszczeń: (1) wniosek o rozstrzygnięcie sporu do stałego polubownego sądu konsumenckiego; (2) wniosek w sprawie pozasądowego rozwiązania sporu do wojewódzkiego inspektora Inspekcji lub (3) pomoc powiatowego (miejskiego) rzecznika konsumentów lub organizacji społecznej, do której zadań statutowych należy ochrona konsumentów (m.in. Federacja Konsumentów, Stowarzyszenie Konsumentów Polskich). Porady udzielane są między innymi mailowo pod adresem porady@dlakonsumentow.pl oraz pod numerem infolinii konsumenckiej 801 440 220 (infolinia czynna w Dni Robocze, w godzinach 8:00 - 18:00, opłata za połączenie wg taryfy operatora)</li>\n<li><span style=\"font-weight:800;\">7.4. </span>Pod adresem http://ec.europa.eu/consumers/odr dostępna jest platforma internetowego systemu rozstrzygania sporów pomiędzy konsumentami i przedsiębiorcami na szczeblu unijnym (platforma ODR). Platforma ODR stanowi interaktywną i wielojęzyczną stronę internetową z punktem kompleksowej obsługi dla konsumentów i przedsiębiorców dążących do pozasądowego rozstrzygnięcia sporu dotyczącego zobowiązań umownych wynikających z internetowej umowy sprzedaży lub umowy o świadczenie usług (więcej informacji na stronie samej platformy lub pod adresem internetowym Urzędu Ochrony Konkurencji i Konsumentów: https://polubowne.uokik.gov.pl/platforma-odr,161,pl.html).</li>\n</ul>\n<h3 style=\"margin-bottom:5px;margin-top:0px;font-weight:500;line-height:normal;font-size:36px;color:#3c3c3d;letter-spacing:-1.44px;\">8. PRAWO ODSTĄPIENIA OD UMOWY</h3>\n<ul style=\"margin-bottom:1rem;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">8.1.</span> Konsument, który zawarł umowę na odległość, może w terminie 14 dni kalendarzowych odstąpić od niej bez podawania przyczyny i bez ponoszenia kosztów, z wyjątkiem kosztów określonych w pkt. 8.7 Regulaminu. Do zachowania terminu wystarczy wysłanie oświadczenia przed jego upływem. Oświadczenie o odstąpieniu od umowy może zostać złożone na przykład:\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">8.1.1.</span> pisemnie na adres: ul. Krakowska 51A, 32-566 Alwernia;</li>\n<li><span style=\"font-weight:800;\">8.1.2.</span> w formie elektronicznej za pośrednictwem poczty elektronicznej na adres: sklep@magiakamieni.pl;</li>\n</ul>\n</li>\n<li><span style=\"font-weight:800;\">8.2. </span>Zwrot Produktu - rzeczy ruchomych (w tym rzeczy ruchomych z elementami cyfrowymi) w ramach odstąpienia od umowy może nastąpić na adres: ul. Krakowska 51A, 32-566 Alwernia.</li>\n<li><span style=\"font-weight:800;\">8.3.</span> Przykładowy wzór formularza odstąpienia od umowy zawarty jest w załączniku nr 2 do Ustawy o Prawach Konsumenta oraz dodatkowo dostępny jest w pkt. 13 Regulaminu. Konsument może skorzystać ze wzoru formularza, jednak nie jest to obowiązkowe.</li>\n<li><span style=\"font-weight:800;\">8.4.</span> Bieg terminu do odstąpienia od umowy rozpoczyna się:\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">8.4.1.</span>dla umowy, w wykonaniu której Sprzedawca wydaje Produkt, będąc zobowiązany do przeniesienia jego własności – od objęcia Produktu w posiadanie przez konsumenta lub wskazaną przez niego osobę trzecią inną niż przewoźnik, a w przypadku umowy, która: (1) obejmuje wiele Produktów, które są dostarczane osobno, partiami lub w częściach – od objęcia w posiadanie ostatniego Produktu, partii lub części albo (2) polega na regularnym dostarczaniu Produktów przez czas oznaczony – od objęcia w posiadanie pierwszego z Produktów;</li>\n<li><span style=\"font-weight:800;\">8.4.2.</span> dla pozostałych umów – od dnia zawarcia umowy. /li&gt;</li>\n</ul>\n</li>\n<li><span style=\"font-weight:800;\">8.5. </span>W przypadku odstąpienia od umowy zawartej na odległość umowę uważa się za niezawartą.</li>\n<li><span style=\"font-weight:800;\">8.6.</span>Produkty - rzeczy ruchome, w tym rzeczy ruchome z elementami cyfrowymi:\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">8.6.1.</span> Sprzedawca ma obowiązek niezwłocznie, nie później niż w terminie 14 dni kalendarzowych od dnia otrzymania oświadczenia konsumenta o odstąpieniu od umowy, zwrócić konsumentowi wszystkie dokonane przez niego płatności, w tym koszty dostarczenia Produktu - rzeczy ruchomej, w tym rzeczy ruchomej z elementami cyfrowymi (z wyjątkiem dodatkowych kosztów wynikających z wybranego przez konsumenta sposobu dostarczenia innego niż najtańszy zwykły sposób dostawy dostępny w Sklepie Internetowym). Sprzedawca dokonuje zwrotu płatności przy użyciu takiego samego sposobu płatności, jakiego użył konsument, chyba że konsument wyraźnie zgodził się na inny sposób zwrotu, który nie wiąże się dla niego z żadnymi kosztami. W przypadku Produktów - rzeczy ruchomych (w tym rzeczy ruchomych z elementami cyfrowymi) - jeżeli Sprzedawca nie zaproponował, że sam odbierze Produkt od konsumenta, może wstrzymać się ze zwrotem płatności otrzymanych od konsumenta do chwili otrzymania Produktu z powrotem lub dostarczenia przez konsumenta dowodu jego odesłania, w zależności od tego, które zdarzenie nastąpi wcześniej.</li>\n<li><span style=\"font-weight:800;\">8.6.2.</span> W przypadku Produktów - rzeczy ruchomych (w tym rzeczy ruchomych z elementami cyfrowymi) - konsument ma obowiązek niezwłocznie, nie później niż w terminie 14 dni kalendarzowych od dnia, w którym odstąpił od umowy, zwrócić Produkt Sprzedawcy lub przekazać go osobie upoważnionej przez Sprzedawcę do odbioru, chyba że Sprzedawca zaproponował, że sam odbierze Produkt. Do zachowania terminu wystarczy odesłanie Produktu przed jego upływem.</li>\n<li><span style=\"font-weight:800;\">8.6.3.</span> Konsument ponosi odpowiedzialność za zmniejszenie wartości Produktu - rzeczy ruchomej (w tym rzeczy ruchomej z elementami cyfrowymi) - będące wynikiem korzystania z niego w sposób wykraczający poza konieczny do stwierdzenia charakteru, cech i funkcjonowania Produktu.</li>\n</ul>\n</li>\n<li><span style=\"font-weight:800;\">8.7.</span>Możliwe koszty związane z odstąpieniem przez konsumenta od umowy, które obowiązany jest ponieść konsument:\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">8.7.1.</span>W przypadku Produktów - rzeczy ruchomych (w tym rzeczy ruchomych z elementami cyfrowymi) - jeżeli konsument wybrał sposób dostawy Produktu inny niż najtańszy zwykły sposób dostawy dostępny w Sklepie Internetowym, Sprzedawca nie jest zobowiązany do zwrotu konsumentowi poniesionych przez niego dodatkowych kosztów.</li>\n<li><span style=\"font-weight:800;\">8.7.2.</span>W przypadku Produktów - rzeczy ruchomych (w tym rzeczy ruchomych z elementami cyfrowymi) - konsument ponosi bezpośrednie koszty zwrotu Produktu.</li>\n<li><span style=\"font-weight:800;\">8.7.3.</span>W przypadku Produktu - usługi, której wykonywanie – na wyraźne żądanie konsumenta – rozpoczęło się przed upływem terminu do odstąpienia od umowy, konsument, który wykonuje prawo odstąpienia od umowy po zgłoszeniu takiego żądania, ma obowiązek zapłaty za świadczenia spełnione do chwili odstąpienia od umowy. Kwotę zapłaty oblicza się proporcjonalnie do zakresu spełnionego świadczenia, z uwzględnieniem uzgodnionej w umowie ceny lub wynagrodzenia. Jeżeli cena lub wynagrodzenie są nadmierne, podstawą obliczenia tej kwoty jest wartość rynkowa spełnionego świadczenia.</li>\n</ul>\n</li>\n<li><span style=\"font-weight:800;\">8.8.</span>Prawo odstąpienia od umowy zawartej na odległość nie przysługuje konsumentowi w odniesieniu do umów:\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">8.8.1</span>(1) o świadczenie usług, za które konsument jest zobowiązany do zapłaty ceny, jeżeli Sprzedawca wykonał w pełni usługę za wyraźną i uprzednią zgodą konsumenta, który został poinformowany przed rozpoczęciem świadczenia, że po spełnieniu świadczenia przez Sprzedawcę utraci prawo odstąpienia od umowy, i przyjął to do wiadomości; (2) w której cena lub wynagrodzenie zależy od wahań na rynku finansowym, nad którymi Sprzedawca nie sprawuje kontroli, i które mogą wystąpić przed upływem terminu do odstąpienia od umowy; (3) w której przedmiotem świadczenia jest Produkt - rzecz ruchoma (w tym rzecz ruchoma z elementami cyfrowymi) - nieprefabrykowany, wyprodukowany według specyfikacji konsumenta lub służący zaspokojeniu jego zindywidualizowanych potrzeb; (4) w której przedmiotem świadczenia jest Produkt - rzecz ruchoma (w tym rzecz ruchoma z elementami cyfrowymi) - ulegający szybkiemu zepsuciu lub mająca krótki termin przydatności do użycia; (5) w której przedmiotem świadczenia jest Produkt - rzecz ruchoma (w tym rzecz ruchoma z elementami cyfrowymi) - dostarczany w zapieczętowanym opakowaniu, którego po otwarciu opakowania nie można zwrócić ze względu na ochronę zdrowia lub ze względów higienicznych, jeżeli opakowanie zostało otwarte po dostarczeniu; (6) w której przedmiotem świadczenia są Produkty - rzeczy ruchome (w tym rzeczy ruchome z elementami cyfrowymi) -, które po dostarczeniu, ze względu na swój charakter, zostają nierozłącznie połączone z innymi rzeczami ruchomymi, w tym rzeczami ruchomymi z elementami cyfrowymi; (7) w której przedmiotem świadczenia są napoje alkoholowe, których cena została uzgodniona przy zawarciu Umowy Sprzedaży, a których dostarczenie może nastąpić dopiero po upływie 30 dni i których wartość zależy od wahań na rynku, nad którymi Sprzedawca nie ma kontroli; (8) w której konsument wyraźnie żądał, aby Sprzedawca do niego przyjechał w celu dokonania pilnej naprawy lub konserwacji; jeżeli Sprzedawca świadczy dodatkowo inne usługi niż te, których wykonania konsument żądał, lub dostarcza Produkty - rzeczy ruchome (w tym rzeczy ruchome z elementami cyfrowymi) -,inne niż części zamienne niezbędne do wykonania naprawy lub konserwacji, prawo odstąpienia od umowy przysługuje konsumentowi w odniesieniu do dodatkowych usług lub Produktów; (9) w której przedmiotem świadczenia są nagrania dźwiękowe lub wizualne albo programy komputerowe dostarczane w zapieczętowanym opakowaniu, jeżeli opakowanie zostało otwarte po dostarczeniu; (10) o dostarczanie dzienników, periodyków lub czasopism, z wyjątkiem umowy o prenumeratę; (11) zawartej w drodze aukcji publicznej; (12) o świadczenie usług w zakresie zakwaterowania, innych niż do celów mieszkalnych, przewozu towarów, najmu samochodów, gastronomii, usług związanych z wypoczynkiem, wydarzeniami rozrywkowymi, sportowymi lub kulturalnymi, jeżeli w umowie oznaczono dzień lub okres świadczenia usługi; (13) o dostarczanie treści cyfrowych niedostarczanych na nośniku materialnym, za które konsument jest zobowiązany do zapłaty ceny, jeżeli Sprzedawca rozpoczął świadczenie za wyraźną i uprzednią zgodą konsumenta, który został poinformowany przed rozpoczęciem świadczenia, że po spełnieniu świadczenia przez Sprzedawcę utraci prawo odstąpienia od umowy, i przyjął to do wiadomości, a Sprzedawca przekazał konsumentowi potwierdzenie, o którym mowa w art. 15 ust. 1 i 2 albo art. 21 ust. 1 Ustawy o Prawach Konsumenta; (14) o świadczenie usług, za które konsument jest zobowiązany do zapłaty ceny w przypadku których konsument wyraźnie zażądał od Sprzedawcy, aby przyjechał do niego w celu dokonania naprawy, a usługa została już w pełni wykonana za wyraźną i uprzednią zgodą konsumenta.</li>\n</ul>\n</li>\n<li><span style=\"font-weight:800;\">8.9.</span> Zawarte w niniejszym punkcie 8. Regulaminu postanowienia dotyczące konsumenta stosuje się od dnia 1 stycznia 2021 r. i dla umów zawartych od tego dnia również do Usługobiorcy lub Klienta będącego osobą fizyczną zawierającą umowę bezpośrednio związaną z jej działalnością gospodarczą, gdy z treści tej umowy wynika, że nie posiada ona dla tej osoby charakteru zawodowego, wynikającego w szczególności z przedmiotu wykonywanej przez nią działalności gospodarczej, udostępnionego na podstawie przepisów o Centralnej Ewidencji i Informacji o Działalności Gospodarczej.</li>\n</ul>\n<h3 style=\"margin-bottom:5px;margin-top:0px;font-weight:500;line-height:normal;font-size:36px;color:#3c3c3d;letter-spacing:-1.44px;\">9.POSTANOWIENIA DOTYCZĄCE PRZEDSIĘBIORCÓW</h3>\n<ul style=\"margin-bottom:1rem;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">9.1.</span> Niniejszy punkt 9. Regulaminu oraz wszystkie postanowienia w nim zawarte są skierowane i tym samym wiążą wyłącznie Klienta lub Usługobiorcę niebędącego konsumentem, a od dnia 1 stycznia 2021 r. i dla umów zawartych od tego dnia niebędącego także osobą fizyczną zawierającą umowę bezpośrednio związaną z jej działalnością gospodarczą, gdy z treści tej umowy wynika, że nie posiada ona dla tej osoby charakteru zawodowego, wynikającego w szczególności z przedmiotu wykonywanej przez nią działalności gospodarczej, udostępnionego na podstawie przepisów o Centralnej Ewidencji i Informacji o Działalności Gospodarczej.</li>\n<li><span style=\"font-weight:800;\">9.2.</span> Sprzedawcy przysługuje prawo odstąpienia od Umowy Sprzedaży w terminie 14 dni kalendarzowych od dnia jej zawarcia. Odstąpienie od Umowy Sprzedaży w tym wypadku może nastąpić bez podania przyczyny i nie rodzi po stronie Klienta żadnych roszczeń w stosunku do Sprzedawcy.</li>\n<li><span style=\"font-weight:800;\">9.3.</span> Sprzedawca ma prawo ograniczyć dostępne sposoby płatności, w tym także wymagać dokonania przedpłaty w całości albo części i to niezależnie od wybranego przez Klienta sposobu płatności oraz faktu zawarcia Umowy Sprzedaży.</li>\n<li><span style=\"font-weight:800;\">9.4.</span> Usługodawca może wypowiedzieć umowę o świadczenie Usługi Elektronicznej ze skutkiem natychmiastowym i bez wskazywania przyczyn poprzez przesłanie Usługobiorcy stosownego oświadczenia.</li>\n<li><span style=\"font-weight:800;\">9.5.</span>Odpowiedzialność Usługodawcy/Sprzedawcy w stosunku do Usługobiorcy/Klienta, bez względu na jej podstawę prawną, jest ograniczona – zarówno w ramach pojedynczego roszczenia, jak również za wszelkie roszczenia w sumie – do wysokości zapłaconej ceny oraz kosztów dostawy z tytułu Umowy Sprzedaży, nie więcej jednak niż do kwoty jednego tysiąca złotych. Ograniczenie kwotowe, o którym mowa w zdaniu poprzednim, ma zastosowanie do wszelkich roszczeń kierowanych przez Usługobiorcę/Klienta w stosunku do Usługodawcy/Sprzedawcy, w tym także w przypadku braku zawarcia Umowy Sprzedaży lub niezwiązanych z Umową Sprzedaży. Usługodawca/Sprzedawca ponosi odpowiedzialność w stosunku do Usługobiorcy/Klienta tylko za typowe szkody przewidywalne w momencie zawarcia umowy i nie ponosi odpowiedzialności z tytułu utraconych korzyści. Sprzedawca nie ponosi także odpowiedzialności za opóźnienie w przewozie przesyłki.</li>\n<li><span style=\"font-weight:800;\">9.6.</span> Wszelkie spory powstałe pomiędzy Sprzedawcą/Usługodawcą a Klientem/Usługobiorcą zostają poddane sądowi właściwemu ze względu na siedzibę Sprzedawcy/Usługodawcy.</li>\n<li><span style=\"font-weight:800;\">9.7.</span> Odpowiedzialność Sprzedawcy z tytułu rękojmi za Produkt lub braku zgodności Produktu z Umową Sprzedaży zostaje wyłączona.</li>\n<li><span style=\"font-weight:800;\">9.8.</span>Sprzedawca ustosunkuje się do reklamacji w terminie 30 dni kalendarzowych od dnia jej otrzymania.</li>\n</ul>\n<h3 style=\"margin-bottom:5px;margin-top:0px;font-weight:500;line-height:normal;font-size:36px;color:#3c3c3d;letter-spacing:-1.44px;\">10. OPINIE O SKLEPIE INTERNETOWYM I PRODUKTACH</h3>\n<ul style=\"margin-bottom:1rem;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">10.1.</span>Sprzedawca umożliwia swoim Klientom wystawianie i dostęp do opinii o Sklepie Internetowym na zasadach wskazanych w niniejszym punkcie Regulaminu. Opinie o produktach nie są zbierane.</li>\n<li><span style=\"font-weight:800;\">10.2.</span>Wystawienie opinii przez Klienta możliwe jest po skorzystaniu z formularza umożliwiającego dodanie opinii o Sklepie Internetowym. Formularz ten może być udostępniony bezpośrednio na stronie Sklepu Internetowego (w tym także za pomocą zewnętrznego widgetu) lub może zostać udostępniony za pomocą indywidualnego linku otrzymanego przez Klienta po zakupie na podany przez niego adres poczty elektronicznej. Dodając opinię, Usługobiorca może również dodać ocenę graficzną lub zdjęcie Produktu – jeżeli taka opcja jest dostępna w formularzu opinii.</li>\n<li><span style=\"font-weight:800;\">10.3.</span>Opinia o Sklepie Internetowym może być wystawiona przez osobę będącą Klientem Sklepu Internetowego, do każdego złożonego przez niego zamówienia, które zostało zrealizowane i wysłane.</li>\n<li><span style=\"font-weight:800;\">10.4.</span>Dodawanie opinii przez Klientów nie może być wykorzystywane do działań bezprawnych, w szczególności do działań stanowiących czyn nieuczciwej konkurencji, czy też działań naruszających dobra osobiste, prawa własności intelektualnej lub inne prawa Sprzedawcy lub osób trzecich. Klient dodając opinię obowiązany jest do działania zgodnego z prawem, niniejszym Regulaminem i dobrymi obyczajami.</li>\n<li><span style=\"font-weight:800;\">10.5.</span>Opinie mogą być udostępniane bezpośrednio na stronie Sklepu Internetowego lub w zewnętrznym serwisie zbierającym opinie, z którym współpracuje Sprzedawca i do którego odsyła na stronie Sklepu Internetowego (w tym także za pomocą zewnętrznego widgetu umieszczonego na stronie Sklepu Internetowego).</li>\n<li><span style=\"font-weight:800;\">10.6.</span>Sprzedawca zapewnia aby publikowane opinie pochodziły od jego Klientów, którzy dokonali zakupu w sklepie internetowym. W tym celu Sprzedawca podejmuje następujące działania, aby sprawdzić, czy opinie pochodzą od jego Klientów:\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">10.6.1.</span> Sprzedawca wysyła swoim Klientom (w tym także za pomocą zewnętrznego serwisu zbierającego opinie, z którym współpracuje) indywidualny link na podany przez niego przy zakupie adres poczty elektronicznej – w ten sposób dostęp do formularza opinii otrzymuje wyłącznie Klient, który dokonał zakupu Produktu w Sklepie Internetowym.</li>\n<li><span style=\"font-weight:800;\">10.6.2.</span> W razie wątpliwości Sprzedawcy lub zastrzeżeń kierowanych do Sprzedawcy przez innych Klientów lub osoby trzecie, czy dana opinia pochodzi od Klienta, Sprzedawca zastrzega sobie prawo skontaktowania się z autorem opinii celem wyjaśnienia i potwierdzenia, że faktycznie jest Klientem Sklepu Internetowego.</li>\n</ul>\n</li>\n<li><span style=\"font-weight:800;\">10.7.</span> Wszelkie uwagi, odwołania od weryfikacji opinii, czy też zastrzeżenia czy dana opinia pochodzi od Klienta lub czy dany Klient kupił dany Produkt mogą być zgłaszane w trybie analogicznym do procedury reklamacyjnej wskazanej w punkcie 6. Regulaminu.</li>\n<li><span style=\"font-weight:800;\">10.8.</span>Sprzedawca nie zamieszcza ani nie zleca zamieszczania innej osobie nieprawdziwych opinii lub rekomendacji Klientów oraz nie zniekształca opinii lub rekomendacji Klientów w celu promowania swoich Produktów. Sprzedawca udostępnia opnie zarówno pozytywne, jak i negatywne. Sprzedawca nie udostępnia sponsorowanych opinii.</li>\n</ul>\n<h3 style=\"margin-bottom:5px;margin-top:0px;font-weight:500;line-height:normal;font-size:36px;color:#3c3c3d;letter-spacing:-1.44px;\">11. NIELEGALNE TREŚCI I INNE TREŚCI NIEZGODNE Z REGULAMINEM</h3>\n<ul style=\"margin-bottom:1rem;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">11.1.</span>Niniejszy punkt Regulaminu zawiera postanowienia wynikające z Aktu o Usługach Cyfrowych w zakresie dotyczącym Sklepu Internetowego i Usługodawcy. Usługobiorca co do zasady nie jest zobowiązany do dostarczania treści podczas korzystania ze Sklepu Internetowego, chyba że Regulamin wymaga podania określonych danych (np. dane do złożenia Zamówienia). Usługobiorca może mieć możliwość dodania opinii lub komentarza w Sklepie Internetowym korzystając z narzędzi udostępnionych w tym celu przez Usługodawcę. W każdym wypadku dostarczania treści przez Usługobiorcę jest on zobowiązany do przestrzegania zasad zawartych w Regulaminie.</li>\n<li><span style=\"font-weight:800;\">11.2 </span>PUNKT KONTAKTOWY - Usługodawca wyznacza adres poczty elektronicznej sklep@magiakamieni.pl jako pojedynczy punkt kontaktowy. Punkt kontaktowy umożliwia bezpośrednią komunikację Usługodawcy z organami państw członkowskich, Komisją Europejską i Radą Usług Cyfrowych oraz jednocześnie umożliwia odbiorcom usługi (w tym Usługobiorcom) bezpośrednią, szybką i przyjazną komunikację z Usługodawcą drogą elektroniczną, na potrzeby stosowania Aktu o Usługach Cyfrowych. Usługodawca wskazuje język polski oraz język angielski do celów komunikacji z jego punktem kontaktowym.</li>\n<li><span style=\"font-weight:800;\">11.3 </span>Procedura zgłaszania Nielegalnych Treści i działania zgodnie z art. 16 Aktu o Usługach Cyfrowych:\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">11.3.1.</span>Na adres poczty elektronicznej sklep@magiakamieni.pl dowolna osoba lub dowolny podmiot może zgłosić Usługodawcy obecność określonych informacji, które dana osoba lub dany podmiot uważają za Nielegalne Treści.</li>\n<li><span style=\"font-weight:800;\">11.3.2.</span>Zgłoszenie powinno być wystarczająco precyzyjne i odpowiednio uzasadnione. W tym celu Usługodawca umożliwia i ułatwia dokonywanie na podany wyżej adres poczty elektronicznej zgłoszeń zawierających wszystkie poniższe elementy:(1) wystarczająco uzasadnione wyjaśnienie powodów, dla których dana osoba lub dany podmiot zarzucają, że zgłaszane informacje stanowią Nielegalne Treści;(2) jasne wskazanie dokładnej elektronicznej lokalizacji informacji, takiej jak dokładny adres URL lub dokładne adresy URL, oraz, w stosownych przypadkach, dodatkowe informacje umożliwiające identyfikację Nielegalnych Treści, stosownie do rodzaju treści i konkretnego rodzaju usługi;(3) imię i nazwisko lub nazwę oraz adres e-mail osoby lub podmiotu dokonujących zgłoszenia, z wyjątkiem zgłoszenia dotyczącego informacji uznawanych za związane z jednym z przestępstw, o których mowa w art. 3–7 dyrektywy 2011/93/UE;oraz (4) oświadczenie potwierdzające powzięte w dobrej wierze przekonanie osoby lub podmiotu dokonujących zgłoszenia, że informacje i zarzuty w nim zawarte są prawidłowe i kompletne.</li>\n<li><span style=\"font-weight:800;\">11.3.3.</span>Zgłoszenie, o którym mowa powyżej, uznaje się za dające podstawę do uzyskania faktycznej wiedzy lub wiadomości do celów art. 6 Aktu o Usługach Cyfrowych w odniesieniu do informacji, której dotyczy, jeżeli umożliwia Usługodawcy działającemu z należytą starannością stwierdzenie – bez szczegółowej analizy prawnej – nielegalnego charakteru danej działalności lub informacji.</li>\n<li><span style=\"font-weight:800;\">11.3.4.</span>Jeżeli zgłoszenie zawiera elektroniczne dane kontaktowe osoby lub podmiotu, które dokonały zgłoszenia, Usługodawca bez zbędnej zwłoki przesyła takiej osobie lub takiemu podmiotowi potwierdzenie otrzymania zgłoszenia. Usługodawca powiadamia także bez zbędnej zwłoki taką osobę lub taki podmiot o swojej decyzji w odniesieniu do informacji, których dotyczy zgłoszenie, przekazując informacje na temat możliwości odwołania się od podjętej decyzji.</li>\n<li><span style=\"font-weight:800;\">11.3.5.</span>Usługodawca rozpatruje wszystkie zgłoszenia, które otrzymuje w ramach mechanizmu, o których mowa powyżej, oraz podejmuje decyzje w odniesieniu do informacji, których dotyczą zgłoszenia, w sposób terminowy, niearbitralny i obiektywny oraz z zachowaniem należytej staranności. Jeżeli na potrzeby takiego rozpatrywania lub podejmowania decyzji Usługodawca korzysta ze zautomatyzowanych środków, uwzględnia informacje na ten temat w powiadomieniu, o którym mowa poprzednim punkcie</li>\n</ul>\n</li>\n<li><span style=\"font-weight:800;\">11.4.</span> Informacja na temat ograniczeń, które Usługodawca nakłada w związku z korzystaniem z Sklepu Internetowego, w odniesieniu do informacji przekazywanych przez Usługobiorców\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">11.4.1.</span>Usługobiorcę obowiązują następujące zasady w przypadku dostarczania jakichkolwiek treści w ramach Sklepu Internetowego:\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">11.4.1.1 </span>obowiązek korzystania ze Sklepu Internetowego, w tym do zamieszczania treści (np.w ramach opinii lub komentarzy), zgodnie z jego przeznaczeniem, niniejszym Regulaminem oraz w sposób zgodny z prawem i dobrymi obyczajami, mając na uwadze poszanowanie dóbr osobistych oraz praw autorskich i własności intelektualnej Usługodawcy oraz osób trzecich;</li>\n<li><span style=\"font-weight:800;\">11.4.1.2 </span>obowiązek wprowadzania treści zgodnych ze stanem faktycznym oraz w sposób niewprowadzający w błąd;</li>\n<li><span style=\"font-weight:800;\">11.4.1.3</span> zakaz dostarczania treści o charakterze bezprawnym, w tym zakaz dostarczania Nielegalnych Treści;</li>\n<li><span style=\"font-weight:800;\">11.4.1.4</span> zakaz przesyłania niezamówionych informacji handlowych (spam) za pośrednictwem Sklepu Internetowego;</li>\n<li><span style=\"font-weight:800;\">11.4.1.5</span> zakaz dostarczania treści naruszających powszechnie przyjęte zasady netykiety, w tym zawierających treści wulgarne lub obraźliwe;</li>\n<li><span style=\"font-weight:800;\">11.4.1.6</span> obowiązek posiadania–w przypadku, gdy jest to konieczne –wszelkich wymaganych praw i zezwoleń do dostarczania takich treści na stronach Sklepu Internetowego, w szczególności praw autorskich lub wymaganych licencji, zezwoleń i zgód na ich wykorzystywanie, rozpowszechnianie, udostępnianie, lub publikację, zwłaszcza prawa publikowania i rozpowszechniania w Sklepie Internetowym oraz prawo do wykorzystania i rozpowszechniania wizerunku bądź danych osobowych w przypadku treści, które obejmują wizerunek lub dane osobowe osób trzecich</li>\n<li><span style=\"font-weight:800;\">11.4.1.7</span> obowiązek korzystania ze Sklepu Internetowego w sposób nie stwarzający zagrożenia bezpieczeństwa systemu teleinformatycznego Usługodawcy, Sklepu Internetowego lub osób trzecich.</li>\n</ul>\n</li>\n<li><span style=\"font-weight:800;\">11.4.2.</span>Usługodawca zastrzega sobie prawo moderowania treści dostarczanych przez Usługobiorców na stronę Sklepu Internetowego. Moderowanie odbywa się w dobrej wierze i z należytą starannością oraz z własnej inicjatywy Usługodawcy lub na otrzymane zgłoszenie w celu wykrycia, identyfikacji i usunięcia Nielegalnych Treści lub innych treści niezgodnych z Regulaminem lub uniemożliwienia do nich dostępu lub podejmowania niezbędnych środków, aby spełnić wymogi prawa Unii Europejskiej i prawa krajowego zgodnego z prawem Unii Europejskiej, w tym wymogi określone w Akcie o usługach cyfrowych, bądź też wymogi zawarte w Regulaminie.</li>\n<li><span style=\"font-weight:800;\">11.4.3.</span>Proces moderowania może odbywać się ręcznie przez człowieka lub opierać się na zautomatyzowanych lub częściowo zautomatyzowanych narzędziach ułatwiających Usługodawcy identyfikację Nielegalnych Treści lub innych treści niezgodnych z Regulaminem. Po zidentyfikowaniu takich treści Usługodawca podejmuje decyzję co do ewentualnego usunięcia lub uniemożliwienia dostępu do treści lub w inny sposób ogranicza ich widoczność lub podejmuje inne działania, które uzna za konieczne(np.kontaktuje się z Usługobiorcą celem wyjaśnienia zastrzeżeń i zmiany treści). Usługodawca w sposób jasny i łatwo zrozumiały poinformuje Usługobiorcę, który dostarczył treści(w razie posiadania jego danych kontaktowych)o swojej decyzji, powodach jej podjęcia oraz dostępnych możliwościach odwołania się od tej decyzji.</li>\n<li><span style=\"font-weight:800;\">11.4.4.</span>Usługodawca realizując swoje prawa i obowiązki z Aktu o Usługach Cyfrowych zobowiązany jest działać z należytą starannością, w sposób obiektywny i proporcjonalny oraz z należytym uwzględnieniem praw i prawnie uzasadnionych interesów wszystkich zaangażowanych stron, w tym odbiorców usługi, w szczególności z uwzględnieniem praw zapisanych w Karcie praw podstawowych Unii Europejskiej, takich jak wolność wypowiedzi, wolność i pluralizm mediów i inne prawa podstawowe i wolności.</li>\n</ul>\n</li>\n<li><span style=\"font-weight:800;\">11.5.</span>Wszelkie uwagi, skargi, reklamacje, odwołania lub zastrzeżenia dotyczące decyzji lub innych działań lub brak działań podjętych przez Usługodawcę na podstawie otrzymanego zgłoszenia lub decyzji Usługodawcy podjętej zgodnie z postanowieniami niniejszego Regulaminu mogą być zgłaszane w trybie analogicznym do procedury reklamacyjnej wskazanej w punkcie 6. Regulaminu. Korzystanie z tej procedury jest bezpłatne i umożliwia składanie skarg w sposób elektroniczny na podany adres poczty elektronicznej. Skorzystanie z procedury zgłaszania i rozpatrywania skarg pozostaje bez uszczerbku dla prawa danej osoby lub podmiotu do wszczęcia postępowania przed sądem oraz nie narusza jego innych praw</li>\n<li><span style=\"font-weight:800;\">11.6.</span>Usługodawca rozpatruje wszelkie uwagi, skargi, reklamacje, odwołania lub zastrzeżenia dotyczące decyzji lub innych działań lub brak działań podjętych przez Usługodawcę na podstawie otrzymanego zgłoszenia lub podjętej decyzji w sposób terminowy, niedyskryminujący, obiektywny i niearbitralny. Jeżeli skarga lub inne zgłoszenie zawiera wystarczające powody, aby Usługodawca uznał, że jego decyzja o niepodejmowania działań w odpowiedzi na zgłoszenie jest nieuzasadniona lub że informacje, których dotyczy skarga, nie są nielegalne i niezgodne z Regulaminem, lub zawiera informacje wskazujące, że działanie skarżącego nie uzasadnia podjętego środka, Usługodawca bez zbędnej zwłoki uchyla lub zmienia swoją decyzję co do ewentualnego usunięcia lub uniemożliwienia dostępu do treści lub w inny sposób ograniczenia ich widoczności lub podejmuje inne działania, które uzna za konieczne.</li>\n<li><span style=\"font-weight:800;\">11.7.</span>Usługobiorcy, osoby lub podmioty, które dokonały zgłoszenia Nielegalnych Treści, do których skierowane są decyzje Usługodawcy dotyczące Nielegalnych Treści lub treści niezgodnych z Regulaminem, mają prawo wyboru dowolnego organu pozasądowego rozstrzygania sporów certyfikowanego przez koordynatora ds. usług cyfrowych państwa członkowskiego w celu rozstrzygnięcia sporów dotyczących tych decyzji, w tym w odniesieniu do skarg, które nie zostały rozstrzygnięte w ramach wewnętrznego systemu rozpatrywania skarg Usługodawcy.</li>\n</ul>\n<h3 style=\"margin-bottom:5px;margin-top:0px;font-weight:500;line-height:normal;font-size:36px;color:#3c3c3d;letter-spacing:-1.44px;\">12. POSTANOWIENIA KOŃCOWE</h3>\n<ul style=\"margin-bottom:1rem;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">12.1.</span> Umowy zawierane poprzez Sklep Internetowy zawierane są w języku polskim.</li>\n<li><span style=\"font-weight:800;\">12.2.</span> Zmiana Regulaminu:\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">12.2.1.</span> Usługodawca zastrzega sobie prawo do dokonywania zmian niniejszego Regulaminu z ważnych przyczyn, to jest: zmiany przepisów prawa; zmiany sposobów lub terminów płatności lub dostaw, podlegania obowiązkowi prawnemu lub regulacyjnemu; zmiany zakresu lub formy świadczonych Usług Elektronicznych; dodania nowych Usług Elektronicznych; konieczności przeciwdziałania nieprzewidzianemu i bezpośredniemu zagrożeniu związanemu z ochroną Sklepu Internetowego, w tym Usług Elektronicznych i Usługobiorców/Klientów przed oszustwami, złośliwym oprogramowaniem, spamem, naruszeniem danych lub innymi zagrożeniami dla cyberbezpieczeństwa – w zakresie, w jakim te zmiany wpływają na realizację postanowień niniejszego Regulaminu.</li>\n<li><span style=\"font-weight:800;\">12.2.2. </span>. Powiadomienie o proponowanych zmianach wysyłane jest z wyprzedzeniem co najmniej 15 dni przed dniem wejścia w życie tych zmian, z zastrzeżeniem zmiana może być wprowadzona bez zachowania 15-dniowego okresu powiadomienia w przypadku, gdy Usługodawca: (1) podlega obowiązkowi prawnemu lub regulacyjnemu, na podstawie którego zobowiązany jest do zmiany Regulaminu w sposób, który uniemożliwia mu dotrzymanie 15-dniowego okresu powiadomienia; lub (2) musi w drodze wyjątku zmienić swój Regulamin, aby przeciwdziałać nieprzewidzianemu i bezpośredniemu zagrożeniu związanemu z ochroną Sklepu Internetowego, w tym Usług Elektronicznych i Usługobiorców/Klientów przed oszustwami, złośliwym oprogramowaniem, spamem, naruszeniem danych lub innymi zagrożeniami dla cyberbezpieczeństwa. W dwóch ostatnich przypadkach, o których mowa w zdaniu poprzednim, wprowadzenie zmian następuje ze skutkiem natychmiastowym, chyba że możliwe lub konieczne jest zastosowanie dłuższego terminu wprowadzenia zmian, o czym każdorazowo powiadamia Usługodawca.</li>\n<li><span style=\"font-weight:800;\">12.2.3.</span> W przypadku umów o charakterze ciągłym (np. świadczenie Usługi Elektronicznej – Konto) Usługobiorca ma prawo rozwiązać umowę z Usługodawcą przed upływem okresu powiadomienia o proponowanych zmianach. Rozwiązanie takie staje się skuteczne w terminie 15 dni od dnia otrzymania powiadomienia. W przypadku zawarcia umowy o charakterze ciągłym, zmieniony Regulamin wiąże Usługobiorcę, jeżeli został prawidłowo powiadomiony o zmianach, zgodnie z okresem powiadomienia przed ich wprowadzeniem i nie rozwiązał w tym okresie umowy. Dodatkowo w dowolnym momencie po otrzymaniu powiadomienia o zmianach, Usługobiorca może zaakceptować wprowadzane zmiany i tym samym zrezygnować z dalszego trwania okresu powiadomienia. W przypadku zawarcia umowy o innym charakterze niż umowy ciągłe, zmiany Regulaminu nie będą w żaden sposób naruszać praw nabytych Usługobiorcy przed dniem wejścia w życie zmian Regulaminu, w szczególności zmiany Regulaminu nie będą miały wpływu na już składane lub złożone Zamówienia oraz zawarte, realizowane lub wykonane Umowy Sprzedaży.</li>\n<li><span style=\"font-weight:800;\">12.2.4.</span> W wypadku, gdyby zmiana Regulaminu skutkowała wprowadzeniem jakichkolwiek nowych opłat lub podwyższeniem obecnych konsument ma prawo odstąpienia od umowy.</li>\n</ul>\n</li>\n<li><span style=\"font-weight:800;\">12.3.</span> W sprawach nieuregulowanych w niniejszym Regulaminie mają zastosowanie powszechnie obowiązujące przepisy prawa polskiego, w szczególności: Kodeksu Cywilnego; ustawy o świadczeniu usług drogą elektroniczną z dnia 18 lipca 2002 r. (Dz.U. 2002 nr 144, poz. 1204 ze zm.); Ustawy o Prawach Konsumenta; oraz inne właściwe przepisy powszechnie obowiązującego prawa.</li>\n</ul>\n<h3 style=\"margin-bottom:5px;margin-top:0px;font-weight:500;line-height:normal;font-size:36px;color:#3c3c3d;letter-spacing:-1.44px;\">13. WZÓR FORMULARZA ODSTĄPIENIA OD UMOWY<br />(ZAŁĄCZNIK NUMER 2 DO USTAWY O PRAWACH KONSUMENTA)</h3>\n<p class=\"text-center\" style=\"margin-bottom:1rem;margin-top:0px;text-align:center;\"><span style=\"font-weight:800;\"><br />Wzór formularza odstąpienia od umowy</span><span style=\"font-weight:800;\"><br /></span></p>\n<p style=\"margin-bottom:1rem;margin-top:0px;\">(formularz ten należy wypełnić i odesłać tylko w przypadku chęci odstąpienia od umowy)</p>\n<p style=\"margin-bottom:1rem;margin-top:0px;\">– Adresat:</p>\n<p class=\"text-center\" style=\"margin-bottom:1rem;margin-top:0px;text-align:center;\">MAGIA KAMIENI ANNA JANUS<br />ul. Krakowska 51A, 32-566 Alwernia<br />kontakt.magiakamieni.pl<br />sklep@magiakamieni.pl</p>\n<p style=\"margin-bottom:1rem;margin-top:0px;\">– Ja/My(*) niniejszym informuję/informujemy(*) o moim/naszym odstąpieniu od umowy sprzedaży następujących towarów(*) umowy dostawy następujących towarów(*) umowy o dzieło polegającej na wykonaniu następujących towarów(*)/o świadczenie następującej usługi(*)</p>\n<p style=\"margin-bottom:1rem;margin-top:0px;\"></p>\n<p style=\"margin-bottom:1rem;margin-top:0px;\">– Data zawarcia umowy(*)/odbioru(*)</p>\n<p style=\"margin-bottom:1rem;margin-top:0px;\">– Imię i nazwisko konsumenta(-ów)</p>\n<p style=\"margin-bottom:1rem;margin-top:0px;\">– Adres konsumenta(-ów)</p>\n<p style=\"margin-bottom:1rem;margin-top:0px;\">– Podpis konsumenta(-ów) (tylko jeżeli formularz jest przesyłany w wersji papierowej)</p>\n<p style=\"margin-bottom:1rem;margin-top:0px;\">– Data</p>\n<p style=\"margin-bottom:1rem;margin-top:0px;\">(*) Niepotrzebne skreślić.</p>\n<p style=\"margin-bottom:1rem;margin-top:0px;\"><img src=\"https://www.sklep.magiakamieni.pl/img/cms/PP-footer.jpg\" alt=\"Certyfikat\" width=\"100%\" style=\"border-style:none;vertical-align:middle;height:auto;margin-left:auto;margin-right:auto;\" /></p>','regulamin'),(3,2,1,'Polityka prywatności','','Our terms and conditions of use','conditions, terms, use, sell','<p class=\"text-center\" style=\"margin-bottom:1rem;margin-top:0px;text-align:center;\"><img src=\"https://www.sklep.magiakamieni.pl/img/cms/PP_header.jpg\" alt=\"Dbamy o prawa Konsumenta\" width=\"100%\" style=\"border-style:none;vertical-align:middle;height:auto;\" /></p>\n<h2 class=\"text-center\" style=\"margin-bottom:5px;margin-top:0px;font-weight:400;line-height:46.2px;font-size:42px;font-family:\'Gilda Display\', sans-serif;color:#3c3c3d;letter-spacing:-1.68px;text-align:center;\">POLITYKA PRYWATNOŚCI</h2>\n<h3 class=\"text-center\" style=\"margin-bottom:5px;margin-top:0px;font-weight:500;line-height:normal;font-size:36px;color:#3c3c3d;letter-spacing:-1.44px;text-align:center;\">SKLEPU INTERNETOWEGO SKLEP.MAGIAKAMIENI.PL</h3>\n<p style=\"margin-bottom:1rem;margin-top:0px;text-align:justify;\"></p>\n<h3 style=\"margin-bottom:5px;margin-top:0px;font-weight:500;line-height:normal;font-size:36px;color:#3c3c3d;letter-spacing:-1.44px;\">SPIS TREŚCI:</h3>\n<ol style=\"margin-bottom:1rem;margin-top:0px;list-style-position:inside;padding-left:0.75rem;\">\n<li>POSTANOWIENIA OGÓLNE</li>\n<li>PODSTAWY PRZETWARZANIA DANYCH</li>\n<li>CEL, PODSTAWA I OKRES PRZETWARZANIA DANYCH W SKLEPIE INTERNETOWYM</li>\n<li>ODBIORCY DANYCH W SKLEPIE INTERNETOWYM</li>\n<li>PROFILOWANIE W SKLEPIE INTERNETOWYM</li>\n<li>PRAWA OSOBY, KTÓREJ DANE DOTYCZĄ</li>\n<li>COOKIES W SKLEPIE INTERNETOWYM I ANALITYKA</li>\n<li>POSTANOWIENIA KOŃCOWE</li>\n</ol>\n<p style=\"margin-bottom:1rem;margin-top:0px;text-align:justify;\"></p>\n<h3 style=\"margin-bottom:5px;margin-top:0px;font-weight:500;line-height:normal;font-size:36px;color:#3c3c3d;letter-spacing:-1.44px;\">1. POSTANOWIENIA OGÓLNE</h3>\n<ul style=\"margin-bottom:1rem;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">1.1.</span> Niniejsza polityka prywatności Sklepu Internetowego ma charakter informacyjny, co oznacza że nie jest ona źródłem obowiązków dla Usługobiorców lub Klientów Sklepu Internetowego. Polityka prywatności zawiera przede wszystkim zasady dotyczące przetwarzania danych osobowych przez Administratora w Sklepie Internetowym, w tym podstawy, cele i zakres przetwarzania danych osobowych oraz prawa osób, których dane dotyczą, a także informacje w zakresie stosowania w Sklepie Internetowym plików cookies oraz narzędzi analitycznych.</li>\n<li><span style=\"font-weight:800;\">1.2.</span> Administratorem danych osobowych zbieranych za pośrednictwem Sklepu Internetowego jest Anna Janus prowadząca działalność gospodarczą pod firmą MAGIA KAMIENI ANNA JANUS wpisana do Centralnej Ewidencji i Informacji o Działalności Gospodarczej Rzeczypospolitej Polskiej prowadzonej przez ministra właściwego do spraw gospodarki, posiadająca: adres miejsca wykonywania działalności i <span>adres do doręczeń</span>: ul. Krakowska 51A, 32-566 Alwernia, NIP 6581864098, REGON 123234441, adres poczty elektronicznej: sklep@magiakamieni.pl - zwana dalej „<span style=\"font-weight:800;\">Administratorem</span>” i będąca jednocześnie Usługodawcą Sklepu Internetowego i Sprzedawcą.</li>\n<li><span style=\"font-weight:800;\">1.3.</span> Dane osobowe w Sklepie Internetowym przetwarzane są przez Administratora zgodnie z obowiązującymi przepisami prawa, w szczególności zgodnie z rozporządzeniem Parlamentu Europejskiego i Rady (UE) 2016/679 z dnia 27 kwietnia 2016 r. w sprawie ochrony osób fizycznych w związku z przetwarzaniem danych osobowych i w sprawie swobodnego przepływu takich danych oraz uchylenia dyrektywy 95/46/WE (ogólne rozporządzenie o ochronie danych) - zwane dalej „<span style=\"font-weight:800;\">RODO</span>” lub „<span style=\"font-weight:800;\">Rozporządzenie RODO</span>”. Oficjalny tekst Rozporządzenia RODO: <span><a href=\"http://eur-lex.europa.eu/legal-content/PL/TXT/?uri=CELEX%3A32016R0679\" rel=\"nofollow\" style=\"background-color:transparent;color:#303030;\">http://eur-lex.europa.eu/legal-content/PL/TXT/?uri=CELEX%3A32016R0679</a></span></li>\n<li><span style=\"font-weight:800;\">1.4.</span> Korzystanie ze Sklepu Internetowego, w tym dokonywanie zakupów jest dobrowolne. Podobnie związane z tym podanie danych osobowych przez korzystającego ze Sklepu Internetowego Usługobiorcę lub Klienta jest dobrowolne, z zastrzeżeniem dwóch wyjątków: (1) <span style=\"font-weight:800;\">zawieranie umów z Administratorem</span> - niepodanie w przypadkach i w zakresie wskazanym na stronie Sklepu Internetowego oraz w Regulaminie Sklepu Internetowego i niniejszej polityce prywatności danych osobowych niezbędnych do zawarcia i wykonania Umowy Sprzedaży lub umowy o świadczenie Usługi Elektronicznej z Administratorem skutkuje brakiem możliwości zawarcia tejże umowy. Podanie danych osobowych jest w takim wypadku wymogiem umownym i jeżeli osoba, które dane dotyczą chce zawrzeć daną umowę z Administratorem, to jest zobowiązana do podania wymaganych danych. Każdorazowo zakres danych wymaganych do zawarcia umowy wskazany jest uprzednio na stronie Sklepu Internetowego oraz w Regulaminie Sklepu Internetowego; (2) <span style=\"font-weight:800;\">obowiązki ustawowe Administratora</span> - podanie danych osobowych jest wymogiem ustawowym wynikającym z powszechnie obowiązujących przepisów prawa nakładających na Administratora obowiązek przetwarzania danych osobowych (np. przetwarzanie danych w celu prowadzenia ksiąg podatkowych lub rachunkowych) i brak ich podania uniemożliwi Administratorowi wykonanie tychże obowiązków.</li>\n<li><span style=\"font-weight:800;\">1.5. </span>Administrator dokłada szczególnej staranności w celu ochrony interesów osób, których przetwarzane przez niego dane osobowe dotyczą, a w szczególności jest odpowiedzialny i zapewnia, że zbierane przez niego dane są: (1) przetwarzane zgodnie z prawem; (2) zbierane dla oznaczonych, zgodnych z prawem celów i niepoddawane dalszemu przetwarzaniu niezgodnemu z tymi celami; (3) merytorycznie poprawne i adekwatne w stosunku do celów, w jakich są przetwarzane; (4) przechowywane w postaci umożliwiającej identyfikację osób, których dotyczą, nie dłużej niż jest to niezbędne do osiągnięcia celu przetwarzania oraz (5) przetwarzane w sposób zapewniający odpowiednie bezpieczeństwo danych osobowych, w tym ochronę przed niedozwolonym lub niezgodnym z prawem przetwarzaniem oraz przypadkową utratą, zniszczeniem lub uszkodzeniem, za pomocą odpowiednich środków technicznych lub organizacyjnych.</li>\n<li><span style=\"font-weight:800;\">1.6.</span> Uwzględniając charakter, zakres, kontekst i cele przetwarzania oraz ryzyko naruszenia praw lub wolności osób fizycznych o różnym prawdopodobieństwie i wadze zagrożenia, Administrator wdraża odpowiednie środki techniczne i organizacyjne, aby przetwarzanie odbywało się zgodnie z niniejszym rozporządzeniem i aby móc to wykazać. Środki te są w razie potrzeby poddawane przeglądom i uaktualniane. Administrator stosuje środki techniczne zapobiegające pozyskiwaniu i modyfikowaniu przez osoby nieuprawnione, danych osobowych przesyłanych drogą elektroniczną.</li>\n<li><span style=\"font-weight:800;\">1.7. </span>Wszelkie słowa, wyrażenia i akronimy występujące w niniejszej polityce prywatności i rozpoczynające się dużą literą (np. <span style=\"font-weight:800;\">Sprzedawca</span>, <span style=\"font-weight:800;\">Sklep Internetowy</span>, <span style=\"font-weight:800;\">Usługa Elektroniczna</span>) należy rozumieć zgodnie z ich definicją zawartą w Regulaminie Sklepu Internetowego dostępnym na stronach Sklepu Internetowego.</li>\n</ul>\n<p style=\"margin-bottom:1rem;margin-top:0px;\"><br /><br /></p>\n<h3 style=\"margin-bottom:5px;margin-top:0px;font-weight:500;line-height:normal;font-size:36px;color:#3c3c3d;letter-spacing:-1.44px;\">2. PODSTAWY PRZETWARZANIA DANYCH</h3>\n<ul style=\"margin-bottom:1rem;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">2.1.</span> Administrator uprawniony jest do przetwarzania danych osobowych w przypadkach, gdy – i w takim zakresie, w jakim – spełniony jest co najmniej jeden z poniższych warunków: (1) osoba, której dane dotyczą wyraziła zgodę na przetwarzanie swoich danych osobowych w jednym lub większej liczbie określonych celów; (2) przetwarzanie jest niezbędne do wykonania umowy, której stroną jest osoba, której dane dotyczą, lub do podjęcia działań na żądanie osoby, której dane dotyczą, przed zawarciem umowy; (3) przetwarzanie jest niezbędne do wypełnienia obowiązku prawnego ciążącego na Administratorze; lub (4) przetwarzanie jest niezbędne do celów wynikających z prawnie uzasadnionych interesów realizowanych przez Administratora lub przez stronę trzecią, z wyjątkiem sytuacji, w których nadrzędny charakter wobec tych interesów mają interesy lub podstawowe prawa i wolności osoby, której dane dotyczą, wymagające ochrony danych osobowych, w szczególności gdy osoba, której dane dotyczą, jest dzieckiem.</li>\n<li><span style=\"font-weight:800;\">2.2. </span>Przetwarzanie danych osobowych przez Administratora wymaga każdorazowo zaistnienia co najmniej jednej z podstaw wskazanych w pkt. 2.1 polityki prywatności. Konkretne podstawy przetwarzania danych osobowych Usługobiorców i Klientów Sklepu Internetowego przez Administratora są wskazane w kolejnym punkcie polityki prywatności – w odniesieniu do danego celu przetwarzania danych osobowych przez Administratora.</li>\n</ul>\n<p style=\"margin-bottom:1rem;margin-top:0px;\"><br /><br /></p>\n<h3 style=\"margin-bottom:5px;margin-top:0px;font-weight:500;line-height:normal;font-size:36px;color:#3c3c3d;letter-spacing:-1.44px;\">3. CEL, PODSTAWA I OKRES PRZETWARZANIA DANYCH W SKLEPIE INTERNETOWYM</h3>\n<ul style=\"margin-bottom:1rem;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">3.1. </span>Każdorazowo cel, podstawa i okres oraz odbiorcy danych osobowych przetwarzanych przez Administratora wynika z działań podejmowanych przez danego Usługobiorcę lub Klienta w Sklepie Internetowym lub przez Administratora. Przykładowo jeżeli Klient decyduje się na dokonanie zakupów w Sklepie Internetowym i wybierze odbiór osobisty zakupionego Produktu zamiast przesyłki kurierskiej, to jego dane osobowe będą przetwarzane w celu wykonania zawartej Umowy Sprzedaży, ale nie będą już udostępniane przewoźnikowi realizującemu przesyłki na zlecenie Administratora.</li>\n<li><span style=\"font-weight:800;\">3.2.</span> Administrator może przetwarzać dane osobowe w ramach Sklepu Internetowego w następujących celach, na podstawach oraz w okresach wskazanych w poniższej tabeli:</li>\n</ul>\n<div class=\"table-responsive\" style=\"width:1440px;\">\n<table class=\"table table-striped table-bordered\" style=\"border-collapse:collapse;margin-bottom:10px;width:1440px;border:0px;\">\n<tbody>\n<tr style=\"background-color:rgba(0,0,0,0.05);\">\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;width:108px;\">\n<p class=\"text-center\" style=\"margin-bottom:1rem;margin-top:0px;text-align:center;\"><span style=\"font-weight:800;\">Cel przetwarzania danych</span></p>\n</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;width:241px;\">\n<p class=\"text-center\" style=\"margin-bottom:1rem;margin-top:0px;text-align:center;\"><span style=\"font-weight:800;\">Podstawa prawna przetwarzania i okres przechowywania danych</span></p>\n</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;width:243px;\">\n<p class=\"text-center\" style=\"margin-bottom:1rem;margin-top:0px;text-align:center;\"><span style=\"font-weight:800;\">Zakres przetwarzanych danych</span></p>\n</td>\n</tr>\n<tr style=\"vertical-align:top;\">\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\">Wykonanie Umowy Sprzedaży lub umowy o świadczenie Usługi Elektronicznej lub podjęcie działań na żądanie osoby, której dane dotyczą, przed zawarciem w/w umów</p>\n</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\">Artykuł 6 ust. 1 lit. b) Rozporządzenia RODO (wykonanie umowy) – przetwarzanie jest niezbędne do wykonania umowy, której stroną jest osoba, której dane dotyczą, lub do podjęcia działań na żądanie osoby, której dane dotyczą, przed zawarciem umowy</p>\n</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\">Dane są przechowywane przez okres niezbędny do wykonania, rozwiązania lub wygaśnięcia w inny sposób zawartej Umowy Sprzedaży lub umowy o świadczenie Usługi Elektronicznej.</p>\n</td>\n</tr>\n<tr style=\"background-color:rgba(0,0,0,0.05);vertical-align:top;\">\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\">Marketing bezpośredni</p>\n</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\">Artykuł 6 ust. 1 lit. f) Rozporządzenia RODO (prawnie uzasadniony interes administratora) – przetwarzanie jest niezbędne do celów wynikających z prawnie uzasadnionych interesów Administratora – polegających na dbaniu o interesy i dobry wizerunek Administratora, jego Sklepu Internetowego oraz dążeniu do sprzedaży Produktów</p>\n</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\">Dane są przechowywane przez okres istnienia prawnie uzasadnionego interesu realizowanego przez Administratora, nie dłużej jednak niż przez okres przedawnienia roszczeń Administratora w stosunku do osoby, której dane dotyczą, z tytułu prowadzonej przez Administratora działalności gospodarczej. Okres przedawnienia określają przepisy prawa, w szczególności Kodeksu Cywilnego (podstawowy termin przedawnienia dla roszczeń związanych z prowadzeniem działalności gospodarczej wynosi trzy lata, a dla Umowy Sprzedaży dwa lata). Administrator nie może przetwarzać danych w celu marketingu bezpośredniego w przypadku wyrażenia skutecznego sprzeciwu w tym zakresie przez osobę, której dane dotyczą.</p>\n</td>\n</tr>\n<tr style=\"vertical-align:top;\">\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\">Marketing</p>\n</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\">Artykuł 6 ust. 1 lit. a) Rozporządzenia RODO (zgoda) – osoba, której dane dotyczą, wyraziła zgodę na przetwarzanie swoich danych osobowych w celach marketingowych przez Administratora</p>\n</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\">Dane przechowywane są do momentu wycofania zgody przez osobę, której dane dotyczą na dalsze przetwarzanie jej danych w tym celu.</p>\n</td>\n</tr>\n<tr style=\"background-color:rgba(0,0,0,0.05);vertical-align:top;\">\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\">Wyrażenie przez Klienta opinii o zawartej Umowie Sprzedaży</p>\n</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\">Artykuł 6 ust. 1 lit. a) Rozporządzenia RODO – osoba, której dane dotyczą, wyraziła zgodę na przetwarzanie swoich danych osobowych w celu wyrażenia opinii.</p>\n</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\">Dane przechowywane są do momentu wycofania zgody przez osobę, której dane dotyczą na dalsze przetwarzanie jej danych w tym celu.</p>\n</td>\n</tr>\n<tr style=\"vertical-align:top;\">\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\">Prowadzenie ksiąg podatkowych</p>\n</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\">Artykuł 6 ust. 1 lit. c) Rozporządzenia RODO w zw. z art. 86 § 1 Ordynacji podatkowej tj. z dnia 17 stycznia 2017 r. (Dz.U. z 2017 r. poz. 201) – przetwarzanie jest niezbędne do wypełnienia obowiązku prawnego ciążącego na Administratorze</p>\n</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\">Dane są przechowywane przez okres wymagany przepisami prawa nakazującymi Administratorowi przechowywanie ksiąg podatkowych (do czasu upływu okresu przedawnienia zobowiązania podatkowego, chyba że ustawy podatkowe stanowią inaczej).</p>\n</td>\n</tr>\n<tr style=\"background-color:rgba(0,0,0,0.05);vertical-align:top;\">\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\">Ustalenie, dochodzenie lub obrona roszczeń jakie może podnosić Administrator lub jakie mogą być podnoszone wobec Administratora</p>\n</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\">Artykuł 6 ust. 1 lit. f) Rozporządzenia RODO (prawnie uzasadniony interes administratora) – przetwarzanie jest niezbędne do celów wynikających z prawnie uzasadnionych interesów Administratora – polegających na ustaleniu, dochodzeniu lub obronie roszczeń, jakie może podnosić Administrator lub jakie mogą być podnoszone wobec Administratora</p>\n</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\">Dane są przechowywane przez okres istnienia prawnie uzasadnionego interesu realizowanego przez Administratora, nie dłużej jednak niż przez okres przedawnienia roszczeń jakie mogą być podnoszone wobec Administratora (podstawowy termin przedawnienia dla roszczeń wobec Administratora wynosi sześć lat).</p>\n</td>\n</tr>\n<tr style=\"vertical-align:top;\">\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\">Korzystanie ze strony Sklepu Internetowego i zapewnienie jej prawidłowego działania</p>\n</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\">Artykuł 6 ust. 1 lit. f) Rozporządzenia RODO (prawnie uzasadniony interes administratora) – przetwarzanie jest niezbędne do celów wynikających z prawnie uzasadnionych interesów Administratora – polegających na prowadzeniu i utrzymaniu strony Sklepu Internetowego</p>\n</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\">Dane są przechowywane przez okres istnienia prawnie uzasadnionego interesu realizowanego przez Administratora, nie dłużej jednak niż przez okres przedawnienia roszczeń Administratora w stosunku do osoby, której dane dotyczą, z tytułu prowadzonej przez Administratora działalności gospodarczej. Okres przedawnienia określają przepisy prawa, w szczególności Kodeksu Cywilnego (podstawowy termin przedawnienia dla roszczeń związanych z prowadzeniem działalności gospodarczej wynosi trzy lata, a dla Umowy Sprzedaży dwa lata).</p>\n</td>\n</tr>\n<tr style=\"background-color:rgba(0,0,0,0.05);vertical-align:top;\">\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\">Prowadzenie statystyk i analiza ruchu w Sklepie Internetowym</p>\n</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\">Artykuł 6 ust. 1 lit. f) Rozporządzenia RODO (prawnie uzasadniony interes administratora) – przetwarzanie jest niezbędne do celów wynikających z prawnie uzasadnionych interesów Administratora – polegających na prowadzeniu statystyk i analizie ruchu w Sklepie Internetowym celem poprawy funkcjonowania Sklepu Internetowego i zwiększenia sprzedaży Produktów</p>\n</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\">Dane są przechowywane przez okres istnienia prawnie uzasadnionego interesu realizowanego przez Administratora, nie dłużej jednak niż przez okres przedawnienia roszczeń Administratora w stosunku do osoby, której dane dotyczą, z tytułu prowadzonej przez Administratora działalności gospodarczej. Okres przedawnienia określają przepisy prawa, w szczególności Kodeksu Cywilnego (podstawowy termin przedawnienia dla roszczeń związanych z prowadzeniem działalności gospodarczej wynosi trzy lata, a dla Umowy Sprzedaży dwa lata).</p>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n<h3 style=\"margin-bottom:5px;margin-top:0px;font-weight:500;line-height:normal;font-size:36px;color:#3c3c3d;letter-spacing:-1.44px;\">4. ODBIORCY DANYCH W SKLEPIE INTERNETOWYM</h3>\n<div class=\"table-responsive\" style=\"width:1440px;\">\n<div>\n<ul style=\"margin-bottom:1rem;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">4.1.</span> Dla prawidłowego funkcjonowania Sklepu Internetowego, w tym dla realizacji zawieranych Umów Sprzedaży konieczne jest korzystanie przez Administratora z usług podmiotów zewnętrznych (takich jak np. dostawca oprogramowania, kurier, czy podmiot obsługujący płatności). Administrator korzysta wyłącznie z usług takich podmiotów przetwarzających, którzy zapewniają wystarczające gwarancje wdrożenia odpowiednich środków technicznych i organizacyjnych, tak by przetwarzanie spełniało wymogi Rozporządzenia RODO i chroniło prawa osób, których dane dotyczą.</li>\n<li><span style=\"font-weight:800;\">4.2. </span>Przekazanie danych przez Administratora nie następuje w każdym wypadku i nie do wszystkich wskazanych w polityce prywatności odbiorców lub kategorii odbiorców – Administrator przekazuje dane wyłącznie wtedy, gdy jest to niezbędne do realizacji danego celu przetwarzania danych osobowych i tylko w zakresie niezbędnym do jego zrealizowania. Przykładowo, jeżeli Klient korzysta z odbioru osobistego, to jego dane nie będą przekazywane przewoźnikowi współpracującemu z Administratorem.</li>\n<li><span style=\"font-weight:800;\">4.3. </span>Dane osobowe Usługobiorców i Klientów Sklepu Internetowego mogą być przekazywane następującym odbiorcom lub kategoriom odbiorców:\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">4.3.1. przewoźnicy / spedytorzy / brokerzy kurierscy</span> - w przypadku Klienta, który korzysta w Sklepie Internetowym ze sposobu dostawy Produktu przesyłką pocztową lub przesyłką kurierską, Administrator udostępnia zebrane dane osobowe Klienta wybranemu przewoźnikowi, spedytorowi lub pośrednikowi realizującemu przesyłki na zlecenie Administratora w zakresie niezbędnym do zrealizowania dostawy Produktu Klientowi.</li>\n<li><span style=\"font-weight:800;\">4.3.2. podmioty obsługujące płatności elektroniczne lub kartą płatniczą</span> - w przypadku Klienta, który korzysta w Sklepie Internetowym ze sposobu płatności elektronicznych lub kartą płatniczą Administrator udostępnia zebrane dane osobowe Klienta wybranemu podmiotowi obsługującemu powyższe płatności w Sklepie Internetowym na zlecenie Administratora w zakresie niezbędnym do obsługi płatności realizowanej przez Klienta.</li>\n<li><span style=\"font-weight:800;\">4.3.3. dostawcy systemu ankiet opiniujących</span> - w przypadku Klienta, który zgodził się na wyrażenie opinii o zawartej Umowie Sprzedaży, Administrator udostępnia zebrane dane osobowe Klienta wybranemu podmiotowi dostarczającemu system ankiet opiniujących zawarte Umowy Sprzedaży w Sklepie Internetowym na zlecenie Administratora w zakresie niezbędnym do wyrażenia przez Klienta opinii za pomocą systemu ankiet opiniujących.</li>\n<li><span style=\"font-weight:800;\">4.3.4. dostawcy usług zaopatrujący Administratora w rozwiązania techniczne, informatyczne oraz organizacyjne, umożliwiające Administratorowi prowadzenie działalności gospodarczej, w tym Sklepu Internetowego i świadczonych za jego pośrednictwem Usług Elektronicznych</span> (w szczególności dostawcy oprogramowania komputerowego do prowadzenia Sklepu Internetowego, dostawcy poczty elektronicznej i hostingu oraz dostawcy oprogramowania do zarządzania firmą i udzielania pomocy technicznej Administratorowi) - Administrator udostępnia zebrane dane osobowe Klienta wybranemu dostawcy działającemu na jego zlecenie jedynie w przypadku oraz w zakresie niezbędnym do zrealizowania danego celu przetwarzania danych zgodnego z niniejszą polityką prywatności.</li>\n<li><span style=\"font-weight:800;\">4.3.5. dostawcy usług księgowych, prawnych i doradczych zapewniający Administratorowi wsparcie księgowe, prawne lub doradcze </span>(w szczególności biuro księgowe, kancelaria prawna lub firma windykacyjna) - Administrator udostępnia zebrane dane osobowe Klienta wybranemu dostawcy działającemu na jego zlecenie jedynie w przypadku oraz w zakresie niezbędnym do zrealizowania danego celu przetwarzania danych zgodnego z niniejszą polityką prywatności.</li>\n<li><span style=\"font-weight:800;\">4.3.6. dostawcy umieszczonych na stronie Sklepu Internetowego wtyczek społecznościowych, skryptów oraz innych podobnych narzędzi umożliwiających przeglądarce osoby odwiedzającej stronę Sklepu Internetowego pobieranie treści od dostawców wspomnianych wtyczek </span>(np. logowanie za pomocą danych logowania do serwisu społecznościowego) i przekazywanie w tym celu tym dostawcom danych osobowych osoby odwiedzającej, w tym również:\n<ul style=\"margin-bottom:0px;margin-top:0px;list-style:disc inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">4.3.6.1 Alphabet Inc.</span>– Administrator korzysta na stronie Sklepu Internetowego z wtyczek społecznościowych serwisu YouTube i w związku z tym gromadzi i udostępnia dane osobowe Usługobiorcy korzystającego ze strony Sklepu Internetowego do Alphabet Inc. (1600 Amphitheatre Parkway Mountain View, CA 94043, Stany Zjednoczone Ameryki) w zakresie i zgodnie z zasadami prywatności dostępnymi tutaj: https://www.youtube.com/intl/ALL_pl/howyoutubeworks/user-settings/privacy/ (dane te obejmują informacje o działaniach na stronie Sklepu Internetowego – w tym informacje o urządzeniu, odwiedzanych witrynach, zakupach, wyświetlanych reklamach oraz sposobie korzystania z usług – niezależnie od tego, czy Usługobiorca ma konto na YouTube i czy jest zalogowany do YouTuba).</li>\n<li><span style=\"font-weight:800;\">4.3.6.2 Google Ireland Ltd.</span>– Administrator korzysta na stronie Sklepu Internetowego z wtyczek społecznościowych serwisu Google (np. logowanie za pomocą danych logowania do serwisu Google) i w związku z tym gromadzi i udostępnia dane osobowe Usługobiorcy korzystającego ze strony Sklepu Internetowego do Google Ireland Ltd. (Gordon House, Barrow Street, Dublin 4, Irlandia) w zakresie i zgodnie z zasadami prywatności dostępnymi tutaj: https://policies.google.com/privacy?hl=pl (dane te obejmują informacje o działaniach na stronie Sklepu Internetowego – w tym informacje o urządzeniu, odwiedzanych witrynach, zakupach, wyświetlanych reklamach oraz sposobie korzystania z usług – niezależnie od tego, czy Usługobiorca ma konto Google i czy jest zalogowany do tego konta.</li>\n<li><span style=\"font-weight:800;\">4.3.6.3 Meta Platforms Ireland Ltd.</span> - Administrator korzysta na stronie Sklepu Internetowego z wtyczek społecznościowych serwisu Facebook (np. przycisk Lubię to!, Udostępnij lub logowanie za pomocą danych logowania do serwisu Facebook) oraz Instagram i w związku z tym gromadzi i udostępnia dane osobowe Usługobiorcy korzystającego ze strony Sklepu Internetowego do Meta Platforms Ireland Ltd. (4 Grand Canal Square, Grand Canal Harbour, Dublin 2 Ireland) w zakresie i zgodnie z zasadami prywatności dostępnymi – w przypadku Facebooka – tutaj: https://www.facebook.com/about/privacy/ oraz – w przypadku Instagrama – tutaj: https://help.instagram.com/519522125107875/?helpref=hc_fnav (dane te obejmują informacje o działaniach na stronie Sklepu Internetowego – w tym informacje o urządzeniu, odwiedzanych witrynach, zakupach, wyświetlanych reklamach oraz sposobie korzystania z usług – niezależnie od tego, czy Usługobiorca ma konto na Facebooku lub Instagramie i czy jest zalogowany do Facebooka lub Instagrama).</li>\n<li><span style=\"font-weight:800;\">4.3.6.4 Smartsupp.com, s.r.o.</span> - Administrator korzysta na stronie Sklepu Internetowego z wtyczek serwisu Smartsupp.com i w związku z tym gromadzi i udostępnia dane osobowe Usługobiorcy korzystającego ze strony Sklepu Internetowego do Smartsupp.com (Šumavská 31, 602 00 Brno, Czech Republic) w zakresie i zgodnie z zasadami prywatności dostępnymi tutaj: https://www.smartsupp.com/help/privacy-policy/.</li>\n<li><span style=\"font-weight:800;\">4.3.6.5 Twitter International Unlimited Company</span> - Administrator korzysta na stronie Sklepu Internetowego z wtyczek społecznościowych serwisu Twitter (np. udostępnianie treści ze Sklepu Internetowego na swoim profilu w serwisie Twitter) i w związku z tym gromadzi i udostępnia dane osobowe Usługobiorcy korzystającego ze strony Sklepu Internetowego do Twitter International Unlimited Company (One Cumberland Place, Fenian Street Dublin 2, D02 AX07 Irlandia) w zakresie i zgodnie z zasadami prywatności dostępnymi tutaj: https://twitter.com/privacy).</li>\n</ul>\n</li>\n</ul>\n</li>\n</ul>\n</div>\n</div>\n<h3 style=\"margin-bottom:5px;margin-top:0px;font-weight:500;line-height:normal;font-size:36px;color:#3c3c3d;letter-spacing:-1.44px;\">5. PROFILOWANIE W SKLEPIE INTERNETOWYM</h3>\n<div class=\"table-responsive\" style=\"width:1440px;\">\n<div>\n<ul style=\"margin-bottom:1rem;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">5.1. </span>Rozporządzenie RODO nakłada na Administratora obowiązek informowania o zautomatyzowanym podejmowaniu decyzji, w tym o profilowaniu, o którym mowa w art. 22 ust. 1 i 4 Rozporządzenia RODO, oraz – przynajmniej w tych przypadkach – istotne informacje o zasadach ich podejmowania, a także o znaczeniu i przewidywanych konsekwencjach takiego przetwarzania dla osoby, której dane dotyczą. Mając to na uwadze Administrator podaje w tym punkcie polityki prywatności informacje dotyczące możliwego profilowania.</li>\n<li><span style=\"font-weight:800;\">5.2. </span>Administrator może korzystać w Sklepie Internetowym z profilowania do celów marketingu bezpośredniego, ale decyzje podejmowane na jego podstawie przez Administratora nie dotyczą zawarcia lub odmowy zawarcia Umowy Sprzedaży, czy też możliwości korzystania z Usług Elektronicznych w Sklepie Internetowym. Efektem korzystania z profilowania w Sklepie Internetowym może być np. przyznanie danej osobie rabatu, przesłanie jej kodu rabatowego, przypomnienie o niedokończonych zakupach, przesłanie propozycji Produktu, który może odpowiadać zainteresowaniom lub preferencjom danej osoby lub też zaproponowanie lepszych warunków w porównaniu do standardowej oferty Sklepu Internetowego. Mimo profilowania to dana osoba podejmuje swobodnie decyzję, czy będzie chciała skorzystać z otrzymanego w ten sposób rabatu, czy też lepszych warunków i dokonać zakupu w Sklepie Internetowym.</li>\n<li><span style=\"font-weight:800;\">5.3.</span> Profilowanie w Sklepie Internetowym polega na automatycznej analizie lub prognozie zachowania danej osoby na stronie Sklepu Internetowego np. poprzez dodanie konkretnego Produktu do koszyka, przeglądanie strony konkretnego Produktu w Sklepie Internetowym, czy też poprzez analizę dotychczasowej historii dokonanych zakupów w Sklepie Internetowym. Warunkiem takiego profilowania jest posiadanie przez Administratora danych osobowych danej osoby, aby móc jej następnie przesłać np. kod rabatowy.</li>\n<li><span style=\"font-weight:800;\">5.4. </span>Osoba, której dane dotyczą, ma prawo do tego, by nie podlegać decyzji, która opiera się wyłącznie na zautomatyzowanym przetwarzaniu, w tym profilowaniu, i wywołuje wobec tej osoby skutki prawne lub w podobny sposób istotnie na nią wpływa.</li>\n</ul>\n<p style=\"margin-bottom:1rem;margin-top:0px;\"></p>\n</div>\n</div>\n<h3 style=\"margin-bottom:5px;margin-top:0px;font-weight:500;line-height:normal;font-size:36px;color:#3c3c3d;letter-spacing:-1.44px;\">6. PRAWA OSOBY, KTÓREJ DANE DOTYCZĄ</h3>\n<div class=\"table-responsive\" style=\"width:1440px;\">\n<div>\n<ul style=\"margin-bottom:1rem;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">6.1. Prawo dostępu, sprostowania, ograniczenia, usunięcia lub przenoszenia </span>- osoba, której dane dotyczą, ma prawo żądania od Administratora dostępu do swoich danych osobowych, ich sprostowania, usunięcia („prawo do bycia zapomnianym”) lub ograniczenia przetwarzania oraz ma prawo do wniesienia sprzeciwu wobec przetwarzania, a także ma prawo do przenoszenia swoich danych. Szczegółowe warunki wykonywania wskazanych wyżej praw wskazane są w art. 15-21 Rozporządzenia RODO.</li>\n<li><span style=\"font-weight:800;\">6.2. Prawo do cofnięcia zgody w dowolnym momencie</span> – osoba, której dane przetwarzane są przez Administratora na podstawie wyrażonej zgody (na podstawie art. 6 ust. 1 lit. a) lub art. 9 ust. 2 lit. a) Rozporządzenia RODO), to ma ona prawo do cofnięcia zgody w dowolnym momencie bez wpływu na zgodność z prawem przetwarzania, którego dokonano na podstawie zgody przed jej cofnięciem.</li>\n<li><span style=\"font-weight:800;\">6.3. Prawo wniesienia skargi do organu nadzorczego</span> – osoba, której dane przetwarzane są przez Administratora, ma prawo wniesienia skargi do organu nadzorczego w sposób i trybie określonym w przepisach Rozporządzenia RODO oraz prawa polskiego, w szczególności ustawy o ochronie danych osobowych. Organem nadzorczym w Polsce jest Prezes Urzędu Ochrony Danych Osobowych.</li>\n<li><span style=\"font-weight:800;\">6.4. Prawo do sprzeciwu</span> - osoba, której dane dotyczą, ma prawo w dowolnym momencie wnieść sprzeciw – z przyczyn związanych z jej szczególną sytuacją – wobec przetwarzania dotyczących jej danych osobowych opartego na art. 6 ust. 1 lit. e) (interes lub zadania publiczne) lub f) (prawnie uzasadniony interes administratora), w tym profilowania na podstawie tych przepisów. Administratorowi w takim przypadku nie wolno już przetwarzać tych danych osobowych, chyba że wykaże on istnienie ważnych prawnie uzasadnionych podstaw do przetwarzania, nadrzędnych wobec interesów, praw i wolności osoby, której dane dotyczą, lub podstaw do ustalenia, dochodzenia lub obrony roszczeń.</li>\n<li><span style=\"font-weight:800;\">6.5. Prawo do sprzeciwu dot. marketingu bezpośredniego - j</span>eżeli dane osobowe są przetwarzane na potrzeby marketingu bezpośredniego, osoba, której dane dotyczą, ma prawo w dowolnym momencie wnieść sprzeciw wobec przetwarzania dotyczących jej danych osobowych na potrzeby takiego marketingu, w tym profilowania, w zakresie, w jakim przetwarzanie jest związane z takim marketingiem bezpośrednim.</li>\n<li><span style=\"font-weight:800;\">6.6. </span>W celu realizacji uprawnień, o których mowa w niniejszym punkcie polityki prywatności można kontaktować się z Administratorem poprzez przesłanie stosownej wiadomości pisemnie lub pocztą elektroniczną na adres Administratora wskazany na wstępie polityki prywatności lub korzystając z formularza kontaktowego dostępnego na stronie Sklepu Internetowego.</li>\n</ul>\n</div>\n</div>\n<h3 style=\"margin-bottom:5px;margin-top:0px;font-weight:500;line-height:normal;font-size:36px;color:#3c3c3d;letter-spacing:-1.44px;\">7. COOKIES W SKLEPIE INTERNETOWYM I ANALITYKA</h3>\n<div class=\"table-responsive\" style=\"width:1440px;\">\n<div>\n<ul style=\"margin-bottom:1rem;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">7.1. </span>Pliki Cookies (ciasteczka) są to niewielkie informacje tekstowe w postaci plików tekstowych, wysyłane przez serwer i zapisywane po stronie osoby odwiedzającej stronę Sklepu Internetowego (np. na dysku twardym komputera, laptopa, czy też na karcie pamięci smartfonu – w zależności z jakiego urządzenia korzysta odwiedzający nasz Sklep Internetowy). Szczegółowe informacje dot. plików Cookies, a także historię ich powstania można znaleźć m. in. tutaj: https://pl.wikipedia.org/wiki/HTTP_cookie .</li>\n<li><span style=\"font-weight:800;\">7.2.</span> Pliki Cookies, które mogą być wysyłane przez stronę Sklepu internetowego można podzielić na różne rodzaje, według następujących kryteriów:</li>\n</ul>\n<div class=\"table-responsive\" style=\"width:1440px;\">\n<table class=\"table table-bordered table-striped\" style=\"border-collapse:collapse;margin-bottom:10px;width:1440px;border:0px;\">\n<tbody>\n<tr style=\"background-color:rgba(0,0,0,0.05);vertical-align:top;\">\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\"><span style=\"font-weight:800;\">Ze względu na ich dostawcę:</span></p>\n<p style=\"margin-bottom:1rem;margin-top:0px;\">1) własne (tworzone przez stronę Sklepu Internetowego Administratora) oraz</p>\n<p style=\"margin-bottom:1rem;margin-top:0px;\">2) należące do osób/podmiotów trzecich (innych niż Administrator)</p>\n</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\"><span style=\"font-weight:800;\">Ze względu na ich okres przechowywania na urządzeniu osoby odwiedzającej stronę Sklepu Internetowego:</span></p>\n<p style=\"margin-bottom:1rem;margin-top:0px;\">1) sesyjne (przechowywane do czasu wylogowania się ze Sklepu Internetowego lub wyłączenia przeglądarki internetowej) oraz</p>\n<p style=\"margin-bottom:1rem;margin-top:0px;\">2) stałe (przechowywane przez określony czas, zdefiniowany przez parametry każdego pliku lub do czasu ręcznego usunięcia)</p>\n</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\"><span style=\"font-weight:800;\">Ze względu na cel ich stosowania:</span></p>\n<p style=\"margin-bottom:1rem;margin-top:0px;\">1) niezbędne (umożliwiające prawidłowe funkcjonowanie strony Sklepu Internetowego),</p>\n<p style=\"margin-bottom:1rem;margin-top:0px;\">2) funkcjonalne/preferencyjne (umożliwiające dostosowanie strony Sklepu Internetowego do preferencji osoby odwiedzającej stronę),</p>\n<p style=\"margin-bottom:1rem;margin-top:0px;\">3) analityczne i wydajnościowe (gromadzące informacje o sposobie korzystania ze strony Sklepu Internetowego),</p>\n<p style=\"margin-bottom:1rem;margin-top:0px;\">4) marketingowe, reklamowe i społecznościowe (zbierające informacje o osobie odwiedzającej stronę Sklepu Internetowego w celu wyświetlania tej osobie spersonalizowanych reklam i prowadzenia innych działań marketingowych w tym również na stronach internetowych odrębnych od strony Sklepu Internetowego, takich jak portale społecznościowe)</p>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n<ul style=\"margin-bottom:1rem;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">7.3. </span>Administrator może przetwarzać dane zawarte w plikach Cookies podczas korzystania przez odwiedzających ze strony Sklepu Internetowego w następujących konkretnych celach:</li>\n</ul>\n<div class=\"table-responsive\" style=\"width:1440px;\">\n<table class=\"table table-bordered table-striped\" style=\"border-collapse:collapse;margin-bottom:10px;width:1440px;border:0px;\">\n<tbody>\n<tr style=\"background-color:rgba(0,0,0,0.05);vertical-align:top;\">\n<td rowspan=\"6\" style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\"><span style=\"font-weight:800;\">Cele stosowanie plików Cookies w Sklepie Internetowym Administratora</span></p>\n</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\">identyfikacji Usługobiorców jako zalogowanych w Sklepie Internetowym i pokazywania, że są zalogowani (pliki Cookies niezbędne)</p>\n</td>\n</tr>\n<tr style=\"vertical-align:top;\">\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">zapamiętywania Produktów dodanych do koszyka w celu złożenia Zamówienia (pliki Cookies niezbędne)</td>\n</tr>\n<tr style=\"background-color:rgba(0,0,0,0.05);vertical-align:top;\">\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">zapamiętywania danych z wypełnianych Formularzy Zamówienia, ankiet lub danych logowania do Sklepu Internetowego (pliki Cookies niezbędne lub/i funkcjonalne/preferencyjne)</td>\n</tr>\n<tr style=\"vertical-align:top;\">\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">dostosowywania zawartości strony Sklepu Internetowego do indywidualnych preferencji Usługobiorcy (np. dotyczących kolorów, rozmiaru czcionki, układu strony) oraz optymalizacji korzystania ze stron Sklepu Internetowego (pliki Cookies funkcjonalne/preferencyjne)</td>\n</tr>\n<tr style=\"background-color:rgba(0,0,0,0.05);vertical-align:top;\">\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">prowadzenia anonimowych statystyk przedstawiających sposób korzystania ze strony Sklepu Internetowego (pliki Cookies analityczne i wydajnościowe)</td>\n</tr>\n<tr style=\"vertical-align:top;\">\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">remarketingu, to jest badania cech zachowania odwiedzających Sklep Internetowy poprzez anonimową analizę ich działań (np. powtarzające się wizyty na określonych stronach, słowa kluczowe itp.) w celu stworzenia ich profilu i dostarczenia im reklam dopasowanych do ich przewidywanych zainteresowań, także wtedy kiedy odwiedzają oni inne strony internetowe w sieci reklamowej firmy Google Ireland Ltd. oraz Facebook Ireland Ltd. (pliki Cookies marketingowe, reklamowe i społecznościowe)</td>\n</tr>\n</tbody>\n</table>\n</div>\n<ul style=\"margin-bottom:1rem;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">7.4.</span> Sprawdzenie w najpopularniejszych przeglądarkach internetowych, jakie pliki Cookies (w tym okres funkcjonowania plików Cookies oraz ich dostawca) są wysyłane w danej chwili przez stronę Sklepu Internetowego jest możliwe w następujący sposób:</li>\n</ul>\n<div class=\"table-responsive\" style=\"width:1440px;\">\n<table class=\"table table-bordered table-striped\" style=\"border-collapse:collapse;margin-bottom:10px;width:1440px;border:0px;\">\n<tbody>\n<tr style=\"background-color:rgba(0,0,0,0.05);vertical-align:top;\">\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\"><span style=\"font-weight:800;\">W przeglądarce Chrome:</span></p>\n<p style=\"margin-bottom:1rem;margin-top:0px;\">(1) w pasku adresu kliknij w ikonkę kłódki po lewej stronie, (2) przejdź do zakładki „Pliki cookie”.</p>\n</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\"><span style=\"font-weight:800;\">W przeglądarce Firefox:</span></p>\n<p style=\"margin-bottom:1rem;margin-top:0px;\">(1) w pasku adresu kliknij w ikonkę tarczy po lewej stronie, (2) przejdź do zakładki „Dopuszczone” lub „Zablokowane”, (3) kliknij pole „Ciasteczka śledzące między witrynami”, „Elementy śledzące serwisów społecznościowych” lub „Treści z elementami śledzącymi”</p>\n</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\"><span style=\"font-weight:800;\">W przeglądarce Internet Explorer:</span></p>\n<p style=\"margin-bottom:1rem;margin-top:0px;\">(1) kliknij menu „Narzędzia”, (2) przejdź do zakładki „Opcje internetowe”, (3) przejdź do zakładki „Ogólne”, (4) przejdź do zakładki „Ustawienia”, (5) kliknij pole „Wyświetl pliki”</p>\n</td>\n</tr>\n<tr style=\"vertical-align:top;\">\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\"><span style=\"font-weight:800;\">W przeglądarce Opera:</span></p>\n<p style=\"margin-bottom:1rem;margin-top:0px;\">(1) w pasku adresu kliknij w ikonkę kłódki po lewej stronie, (2) przejdź do zakładki „Pliki cookie”.</p>\n</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\"><span style=\"font-weight:800;\">w przeglądarce Safari:</span></p>\n<p style=\"margin-bottom:1rem;margin-top:0px;\">(1) kliknij menu „Preferencje”, (2) przejdź do zakładki „Prywatność”, (3) kliknij w pole „Zarządzaj danymi witryn”</p>\n</td>\n<td style=\"border:1px solid #dddddd;padding:0.75rem;vertical-align:top;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\"><span style=\"font-weight:800;\">Niezależnie od przeglądarki, za pomocą narzędzi dostępnych np. na stronie:</span></p>\n<p style=\"margin-bottom:1rem;margin-top:0px;\">https://www.cookiemetrix.com/ lub: https://www.cookie-checker.com/</p>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n<ul style=\"margin-bottom:1rem;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">7.5. </span>Standardowo większość przeglądarek internetowych dostępnych na rynku domyślnie akceptuje zapisywanie plików Cookies. Każdy ma możliwość określenia warunków korzystania z plików Cookies za pomocą ustawień własnej przeglądarki internetowej. Oznacza to, że można np. częściowo ograniczyć (np. czasowo) lub całkowicie wyłączyć możliwość zapisywania plików Cookies – w tym ostatnim wypadku jednak może to mieć wpływ na niektóre funkcjonalności Sklepu Internetowego (przykładowo niemożliwym może okazać się przejście ścieżki Zamówienia poprzez Formularz Zamówienia z uwagi na niezapamiętywanie Produktów w koszyku podczas kolejnych kroków składania Zamówienia).</li>\n<li><span style=\"font-weight:800;\">7.6. </span>Ustawienia przeglądarki internetowej w zakresie plików Cookies są istotne z punktu widzenia zgody na korzystanie z plików Cookies przez nasz Sklep Internetowy – zgodnie z przepisami taka zgoda może być również wyrażona poprzez ustawienia przeglądarki internetowej. Szczegółowe informacje na temat zmiany ustawień dotyczących plików Cookies oraz ich samodzielnego usuwania w najpopularniejszych przeglądarkach internetowych dostępne są w dziale pomocy przeglądarki internetowej oraz na poniższych stronach (wystarczy kliknąć w dany link):<br /><span><a href=\"http://support.google.com/chrome/bin/answer.py?hl=pl&amp;answer=95647\" rel=\"nofollow\" style=\"background-color:transparent;color:#303030;\">w przeglądarce Chrome</a></span><br /><span><a href=\"http://support.mozilla.org/pl/kb/W%C5%82%C4%85czanie%20i%20wy%C5%82%C4%85czanie%20obs%C5%82ugi%20ciasteczek\" rel=\"nofollow\" style=\"background-color:transparent;color:#303030;\">w przeglądarce Firefox</a></span><br /><span><a href=\"https://support.microsoft.com/pl-pl/help/17442/windows-internet-explorer-delete-manage-cookies\" rel=\"nofollow\" style=\"background-color:transparent;color:#303030;\">w przeglądarce Internet Explorer</a></span><br /><span><a href=\"https://help.opera.com/pl/latest/web-preferences/#cookies\" rel=\"nofollow\" style=\"background-color:transparent;color:#303030;\">w przeglądarce Opera</a></span><br /><span><a href=\"https://support.apple.com/pl-pl/guide/safari/sfri11471/11.0/mac/10.13\" rel=\"nofollow\" style=\"background-color:transparent;color:#303030;\">w przeglądarce Safari</a></span><br /><span><a href=\"http://windows.microsoft.com/pl-pl/windows-10/edge-privacy-faq\" rel=\"nofollow\" style=\"background-color:transparent;color:#303030;\">w przeglądarce Microsoft Edge</a></span></li>\n<li><span style=\"font-weight:800;\">7.7.</span> Administrator może korzystać w Sklepie Internetowym z usług Google Analytics, Universal Analytics dostarczanych przez firmę Google Ireland Limited (Gordon House, Barrow Street, Dublin 4, Irlandia). Usługi te pomagają Administratorowi prowadzić statystyki i analizować ruch w Sklepie Internetowym. Gromadzone dane przetwarzane są w ramach powyższych usług do generowania statystyk pomocnych w administrowaniu Sklepie Internetowym i analizie ruchu w Sklepie Internetowym. Dane te mają charakter zbiorczy. Administrator korzystając z powyższych usług w Sklepie Internetowym gromadzi takie dane jak źródła i medium pozyskania odwiedzjących Sklep Internetowy oraz sposób ich zachowania na stronie Sklepu Internetowego, informacje na temat urządzeń i przeglądarek z których odwiedzają stronę, IP oraz domenę, dane geograficzne oraz dane demograficzne (wiek, płeć) i zainteresowania.</li>\n<li><span style=\"font-weight:800;\">7.8. </span>Możliwe jest zablokowanie w łatwy sposób przez daną osobę udostępniania do Google Analytics informacji o jej aktywności na stronie Sklepu Internetowego – w tym celu można na przykład zainstalować dodatek do przeglądarki udostępniany przez firmę Google Ireland Ltd. dostępny tutaj: https://tools.google.com/dlpage/gaoptout?hl=pl.</li>\n<li><span style=\"font-weight:800;\">7.9. </span>Administrator może korzystać w Sklepie Internetowym z usługi Piksel Facebooka dostarczanej przez firmę Facebook Ireland Limited (4 Grand Canal Square, Grand Canal Harbour, Dublin 2, Irlandia). Usługa ta pomaga Administratorowi mierzyć skuteczność reklam oraz dowiadywać się, jakie działania podejmują odwiedzający sklep internetowy, a także wyświetlać tym osobom dopasowane reklamy. Szczegółowe informacje o działaniu Piksela Facebooka możesz znaleźć pod następującym adresem internetowym: https://www.facebook.com/business/help/742478679120153?helpref=page_content.</li>\n<li><span style=\"font-weight:800;\">7.10. </span>Zarządzanie działaniem Piksela Facebooka jest możliwe poprzez ustawienia reklam w swoim koncie na portalu Facebook.com: https://www.facebook.com/ads/preferences/?entry_product=ad_settings_screen.</li>\n</ul>\n<p style=\"margin-bottom:1rem;margin-top:0px;\"></p>\n</div>\n</div>\n<h3 style=\"margin-bottom:5px;margin-top:0px;font-weight:500;line-height:normal;font-size:36px;color:#3c3c3d;letter-spacing:-1.44px;\">8. POSTANOWIENIA KOŃCOWE</h3>\n<div class=\"table-responsive\" style=\"width:1440px;\">\n<div>\n<ul style=\"margin-bottom:1rem;margin-top:0px;list-style:none inside;padding-left:0.75rem;\">\n<li><span style=\"font-weight:800;\">8.1. </span>Sklep Internetowy może zawierać odnośniki do innych stron internetowych. Administrator namawia by po przejściu na inne strony, zapoznać się z polityką prywatności tam ustaloną. Niniejsza polityka prywatności dotyczy tylko Sklepu Internetowego Administratora.</li>\n</ul>\n<p style=\"margin-bottom:1rem;margin-top:0px;\"><img src=\"https://www.sklep.magiakamieni.pl/img/cms/PP-footer.jpg\" alt=\"Certyfikat\" width=\"100%\" style=\"border-style:none;vertical-align:middle;height:auto;margin-left:auto;margin-right:auto;\" /></p>\n</div>\n</div>','polityka-prywatnosci'),(4,2,1,'O nas','','Learn more about us','about us, informations','<p class=\"mb-3 mb-md-5 px-xl-8\" style=\"margin-bottom:40px;margin-top:0px;padding-right:70px;padding-left:70px;\">Sklep Internetowy Magia Kamieni, dostępny pod adresem <a href=\"https://sklep.magiakamieni.pl/\" style=\"background-color:transparent;color:#303030;\">sklep.magiakamieni.pl</a> prowadzony jest przez firmę Magia Kamieni Anna Janus z siedzibą <a href=\"https://www.google.com/maps?cid=16593569988851474211\" rel=\"nofollow noreferrer noopener\" target=\"_blank\" style=\"background-color:transparent;color:#303030;\">w Alwerni przy ul. Krakowskiej 51A</a>, NIP 658-186-40-98, REGON 123234441, wpisaną do Centralnej Ewidencji i Informacji o Działalności Gospodarczej.</p>\n<div class=\"row mb-3 mb-md-5 px-xl-8\" style=\"margin-left:-0.625rem;margin-right:-0.625rem;margin-bottom:40px;padding-right:70px;padding-left:70px;\">\n<div class=\"col-12 col-md-6 mb-2\" style=\"padding-left:0.625rem;padding-right:0.625rem;width:660px;max-width:50%;margin-bottom:10px;\"><img class=\"img-fluid w-100\" src=\"https://sklep.magiakamieni.pl/img/cms/about_us_1.png\" style=\"border-style:none;vertical-align:middle;height:auto;width:640px;\" alt=\"about_us_1.png\" /></div>\n<div class=\"col-12 col-md-6 mb-2\" style=\"padding-left:0.625rem;padding-right:0.625rem;width:660px;max-width:50%;margin-bottom:10px;\"><img class=\"img-fluid w-100\" src=\"https://sklep.magiakamieni.pl/img/cms/about_us_2.png\" style=\"border-style:none;vertical-align:middle;height:auto;width:640px;\" alt=\"about_us_2.png\" /></div>\n</div>\n<p class=\"px-xl-8\" style=\"margin-bottom:1rem;margin-top:0px;padding-right:70px;padding-left:70px;\">Nasza firma powstała w listopadzie 2014 roku, korzystając z pomocy i doświadczenia firmy Mente et Malleo znanej na rynku kolekcjonerskim ze sprzedaży okazów minerałów, skamieniałości i meteorytów. Jej powstanie było odpowiedzią na stale zwiększające się zapotrzebowanie klientów nie tylko na okazy kolekcjonerskie minerałów i skamielin, lecz również na oryginalne wyroby i biżuterię z nich wykonane. Dodatkowo wzbogaciliśmy i uzupełniliśmy ofertę o tańsze minerały zarówno w naturalnej postaci, jak również w postaci otoczaków, plastrów i innych obrobionych formach. Stała współpraca z firmą Mente et Malleo, prowadzoną przez geologa, jest gwarantem oryginalności i wysokiej jakości sprzedawanych kamieni, oraz wyrobów i biżuterii z nich wykonanych. Dzięki zdobywanemu cały czas doświadczeniu i fachowej pomocy ze strony firmy Mente et Malleo, możemy sprostać wszelkim wyzwaniom jakie czekają na nas w tej branży. Towary oferowane w naszym sklepie internetowym to starannie dobrany asortyment produktów wysokiej jakości w atrakcyjnej i przystępnej cenie. W naszej ofercie znajdują się zarówno minerały i skamieliny w naturalnej postaci, jak również wyroby i biżuteria z nich wykonana. W stałej ofercie mamy następujące minerały i kamienie półszlachetne: ametyst, kryształ górski, cytryn, jaspis, obsydian, malachit, awenturyn, agat, karneol, hematyt, kwarc różowy, kwarc dymny, tygrysie oko, sodalit, fluoryt, granat i wiele innych.</p>\n<h2 class=\"text-center mb-5 mt-5\" style=\"margin-bottom:40px;margin-top:40px;font-weight:400;line-height:46.2px;font-size:42px;font-family:\'Gilda Display\', sans-serif;color:#3c3c3d;letter-spacing:-1.68px;text-align:center;\">Dlaczego my ?</h2>\n<ol class=\"mb-3 mb-md-5 px-xl-8\" style=\"margin-top:0px;padding-left:0.75rem;list-style-position:outside;margin-bottom:40px;padding-right:70px;\">\n<li>Uczciwość wobec kupujących jest dla nas sprawą priorytetową. Kupując w naszym sklepie internetowym mają Państwo pewność, że kupują oryginale, naturalne kamienie i produkty z nich wykonane. Jeżeli jest inaczej - to jest to wyraźnie zaznaczone w karcie produktu. Podajemy tam informacje nawet o fakcie, że kamień był dobarwiany czy jest on syntetyczny.</li>\n<li>Staramy się by produkty zawsze były najwyższej jakości. Wszystkie zamieszczone na stronie sklepu zdjęcia i opisy produktów są naszego autorstwa. Staramy się, żeby każdy produkt miał wiarygodne zdjęcia i szczegółowe opisy, tak aby mogli Państwo dokładnie zapoznać się z produktem i podjąć świadomą decyzję co do jego zakupu.</li>\n<li>Wszystkie złożone zamówienia realizowane są tak szybko, jak to tylko możliwe. Przeważnie wysyłka ma miejsce jeszcze w dniu złożenia i opłacenia zamówienia (szczegóły podane są w karcie produktu i regulaminie sklepu). Wszystkie towary znajdujące się w ofercie naszego sklepu posiadamy w magazynie i są one dostępne natychmiast po złożeniu zamówienia.</li>\n<li>Zakupione w naszym sklepie internetowym produkty pakujemy niezwykle starannie, wysyłając je w opakowaniach chroniących zawartość przed uszkodzeniem.</li>\n<li>Aby dokonać zakupu w naszym sklepie internetowym nie jesteście Państwo zobligowani do założenia konta. Jeśli jednak zdecydują się Państwo założyć konto klienta i dokonywać zakupów w naszym sklepie regularnie, wszystkie Wasze zamówienia będą premiowane punktami i kuponami rabatowymi z programu dla stałych klientów. Mogą Państwo liczyć również na atrakcyjne rabaty i promocje skierowane do klientów naszego sklepu internetowego. Dodatkowo oferujemy darmową wysyłkę przy zamówieniach powyżej kwoty 300 zł.</li>\n<li>Zawsze mogą Państwo czuć się bezpiecznie robiąc zakupy w naszym sklepie internetowym. Dzięki wdrożonej Polityce Prywatności dbamy o bezpieczeństwo Waszych danych osobowych. Złożone zamówienia mogą opłacić Państwo za pomocą szybkich i bezpiecznych płatności internetowych, BLIKiem czy też kartą płatniczą. Płatności te realizowane są za pośrednictwem firmy Przelewy24. Transakcje obsługiwane przez tą firmę zapewniają najwyższy poziom bezpieczeństwa i chronione są z użyciem protokołu SSL.</li>\n<li>Respektujemy wszelkie Państwa prawa jako klienta w tym prawo do zwrotu zakupionego towaru w terminie 14 dni bez podania przyczyny.</li>\n</ol>\n<div class=\"row mb-4 mb-md-6 px-xl-8\" style=\"margin-left:-0.625rem;margin-right:-0.625rem;margin-bottom:50px;padding-right:70px;padding-left:70px;\">\n<div class=\"col-12 col-md-6\" style=\"padding-left:0.625rem;padding-right:0.625rem;width:660px;max-width:50%;\"><img class=\"img-fluid w-100 mb-2\" src=\"https://sklep.magiakamieni.pl/img/cms/about_us_3.png\" style=\"border-style:none;vertical-align:middle;height:auto;width:640px;margin-bottom:10px;\" alt=\"about_us_3.png\" /></div>\n<div class=\"col-12 col-md-6\" style=\"padding-left:0.625rem;padding-right:0.625rem;width:660px;max-width:50%;\"><img class=\"img-fluid w-100 mb-2\" src=\"https://sklep.magiakamieni.pl/img/cms/about_us_4.png\" style=\"border-style:none;vertical-align:middle;height:auto;width:640px;margin-bottom:10px;\" alt=\"about_us_4.png\" /></div>\n</div>\n<div class=\"px-xl-8 mb-4 mb-md-6\" style=\"margin-bottom:50px;padding-right:70px;padding-left:70px;\">\n<p style=\"margin-bottom:1rem;margin-top:0px;\">O jakości naszych produktów i usług świadczą liczne komentarze naszych klientów gromadzone i weryfikowane przez firmę TrustMate. Opinie o naszym sklepie znajdziesz na stronie <a href=\"https://trustmate.io/opinie/sklep-magiakamieni-pl\" style=\"background-color:transparent;color:#303030;\">Trustmate.io</a></p>\n<p style=\"margin-bottom:1rem;margin-top:0px;\">Wybierając <a href=\"https://sklep.magiakamieni.pl/\" style=\"background-color:transparent;color:#303030;\">Magia Kamieni</a>, wybierają Państwo gwarancję jakości, autentyczności oraz pełnej satysfakcji z zakupów.</p>\n</div>\n<div class=\"align-items-center bg-green d-flex flex-column pb-5 pb-md-7 pt-3 pt-md-4 px-2\" style=\"padding:30px 10px 60px;background-color:#d7e2db;\"><i class=\"flaticon-star-1 text-gold-400 mb-2\" style=\"font-size:30px;margin-bottom:10px;color:#b17e42;\"></i></div>\n<h5 class=\"mb-4 mb-md-5 text-center\" style=\"margin-bottom:40px;margin-top:0px;font-weight:500;line-height:28.8px;font-size:24px;color:#3c3c3d;letter-spacing:-0.96px;text-align:center;\">Sklep Magia Kamieni w internecie:</h5>\n<div class=\"align-items-center bg-green d-flex flex-column pb-5 pb-md-7 pt-3 pt-md-4 px-2\" style=\"padding:30px 10px 60px;background-color:#d7e2db;\">\n<p class=\"fw-4 text-center\" style=\"margin-bottom:1rem;margin-top:0px;text-align:center;\">Sprawdź, co piszą o nas nasi Klienci na <a class=\"text-underline text-gold-600\" href=\"https://trustmate.io/opinie/sklep-magiakamieni-pl/2\" rel=\"nofollow noreferrer noopener\" target=\"_blank\" style=\"background-color:transparent;color:#71502a;\">Trustmate.io</a></p>\n<p class=\"fw-4 text-center\" style=\"margin-bottom:1rem;margin-top:0px;text-align:center;\">Zobacz nasz certyfikat <a class=\"text-underline text-gold-600\" href=\"https://certyfikat.prokonsumencki.pl/sklep.magiakamieni.pl/\" rel=\"nofollow noreferrer noopener\" target=\"_blank\" style=\"background-color:transparent;color:#71502a;\">Prokonsumencki</a></p>\n<p class=\"fw-4 text-center\" style=\"margin-bottom:1rem;margin-top:0px;text-align:center;\">Sprawdź, jak udekorujesz dom przy użyciu naszych produktów - wg <a class=\"text-underline text-gold-600\" href=\"https://makeitdesign.pl/dekoracje-wielkanocne-ktore-zostana-na-lata/\" rel=\"nofollow noreferrer noopener\" target=\"_blank\" style=\"background-color:transparent;color:#71502a;\">wg makeitdesign.pl</a></p>\n<p class=\"fw-4 text-center\" style=\"margin-bottom:1rem;margin-top:0px;text-align:center;\">Przeczytaj o leczniczych właściwościach naszych kamieni na <a class=\"text-underline text-gold-600\" href=\"https://www.strefaobfitosci.pl/czakra-korzenia-co-ma-wspolnego-ze-swiatowym-chaosem/\" rel=\"nofollow noreferrer noopener\" target=\"_blank\" style=\"background-color:transparent;color:#71502a;\">ajurwedapopolsku.pl</a></p>\n</div>','o-nas'),(5,2,1,'Płatności','','Our secure payment method','secure payment, ssl, visa, mastercard, paypal','<h1>Bezpieczne płatności</h1>\n<p>Dbamy o bezpieczeństwo Twoich transakcji. Nasza strona korzysta z szyfrowania SSL (Secure Sockets Layer), co zapewnia, że wszystkie dane przesyłane podczas dokonywania płatności są w pełni zabezpieczone.</p>\n<p>Metody płatności</p>\n<p>Oferujemy różne, bezpieczne opcje płatności:</p>\n<ul>\n<li><strong>Visa</strong></li>\n<li><strong>Mastercard</strong></li>\n<li><strong>PayPal</strong></li>\n</ul>\n<p>Dzięki tym metodom płatności możesz mieć pewność, że Twoje transakcje są szybkie, wygodne i bezpieczne. Wszystkie płatności są przetwarzane za pomocą certyfikowanych systemów, co gwarantuje ochronę Twoich danych osobowych i finansowych.</p>\n<hr />','platnosci');
