INSERT INTO `ps_product_lang` VALUES (1035,1,2,'Naturalna, nieobrobiona bryłka obsydianu czarnego. Kamień pochodzi z Meksyku. Przybliżona długość kamieni w przedziale: ok.: 30-45 mm. Bryłki wybierane są losowo, cena dotyczy jednej sztuki.','','obsydian-czarny---brylka-30-45-mm---meksyk0','','','','OBSYDIAN CZARNY - BRYŁKA 30-45 mm - MEKSYK','','','',''),(1036,1,2,'Naturalna, nieobrabiana bryłka howlitu o bardzo ładnym zabarwieniu. Maksymalny wymiar bryłek w przedziale 35-40 mm. Zdjęcie przedstawia oferowane kamienie. Bryłka wybierana jest losowo. Podana cena dotyczy jednej sztuki.','','howlit---brylka-35-40-mm1','','','','HOWLIT - BRYŁKA 35-40 mm','','','',''),(1037,1,2,'Tygrysie oko w formie bryłki o maksymalnych wymiarach w przedziale 23-38 mm. Zdjęcia przedstawiają przykładowe, oferowane przez nasz sklep kamienie z tego rodzaju. Bryłka wybierana jest losowo. Podana cena dotyczy jednej sztuki.Obecność spękań, ewentualnych pustek i zagłębień oraz inkluzji innych minerałów jest cechą naturalną kamienia i świadczy o jego powstaniu w naturalnych procesach geologicznych.','','tygrysie-oko---brylka---23-38-mm2','','','','TYGRYSIE OKO - BRYŁKA - 23-38 mm','','','',''),(1038,1,2,'Naturalna, nieobrabiana bryłka sodalitu o ładnym, niebieskim zabarwieniu. Kamień pochodzi z Namibii. Maksymalny wymiar bryłek w przedziale 25-40 mm. Zdjęcie przedstawia oferowane kamienie. Bryłki wybierane są losowo. Podana cena dotyczy jednej sztuki.','','sodalit---brylka-25-40-mm---namibia3','','','','SODALIT - BRYŁKA 25-40 mm - NAMIBIA','','','',''),(1039,1,2,'Naturalna, nieobrabiana bryła obsydianu mahoniowego. Kamień pochodzi z Meksyku. Przybliżone wymiary większości kamieni: ok. 25-35mm. Okaz wybierany jest losowo. Podana cena dotyczy jednej sztuki.','','obsydian-mahoniowy---brylka-25-35-mm---meksyk4','','','','OBSYDIAN MAHONIOWY - BRYŁKA 25-35 mm - MEKSYK','','','',''),(1040,1,2,'Przedmiotem oferty jest naturalna bryłka selenitu. Kamień pochodzi z Maroka. Długość bryłek w przedziale ok. 32-45 mm. Selenity wybierane są losowo. Cena dotyczy jednej bryłki.','','selenit---kamien-ksiezycowy---surowa-brylka5','','','','SELENIT - KAMIEŃ KSIĘŻYCOWY - SUROWA BRYŁKA','','','',''),(1041,1,2,'Naturalna bryłka kwarcu dymnego, pochodzącego z Brazylii. Kamień jest przeświecający. Wymiary większości bryłek w przedziale ok. 25-30 mm. Kwarc wybierany jest losowo. Podana cena dotyczy jednej sztuki.','','kwarc-dymny---brylka-25-30-mm---brazylia6','','','','KWARC DYMNY - BRYŁKA 25-30 mm - BRAZYLIA','','','',''),(1042,1,2,'Bryłki kwarcu różowego pochodzące z Brazylii. Kamień naturalny, nie był szlifowany ani też polerowany. Jest półbłyszczący. Kwarc wybierany jest losowo. Przybliżone wymiary ok. 25-40 mm. Podana cena dotyczy jednej sztuki.','','kwarc-rozowy---brylka-25-40-mm7','','','','KWARC RÓŻOWY - BRYŁKA 25-40 mm','','','',''),(1043,1,2,'Bryłki karneolu w naturalnej, nieobrobionej formie. Karneol pochodzi z Madagaskaru. Przybliżone wymiary większości kamieni w przedziale ok.: 28 do 37 mm. Podana cena dotyczy jednej sztuki. Kamień wybierany jest losowo.','','karneol---brylka-28-37-mm---madagaskar8','','','','KARNEOL - BRYŁKA 28-37 mm - MADAGASKAR','','','',''),(1044,1,2,'Bryłka awenturynu szmaragdowego o ładnym zabarwieniu. Kamień w naturalnej formie, nieszlifowany i niepolerowany. Okazy pochodzą z Brazylii. Awenturyn jest nieprzejrzysty, delikatnie połyskujący. Przybliżone wymiary od ok. 30 do 40 mm. Cena dotyczy jednej sztuki. Kamień wybierany jest losowo.','','awenturyn-szmaragdowy---brylka-30-40-mm9','','','','AWENTURYN SZMARAGDOWY - BRYŁKA 30-40 mm','','','',''),(1045,1,2,'Kryształ górski w postaci bryłki. Kamień surowy, naturalny - nie był polerowany, ani też szlifowany. Przybliżone wymiary bryłek ok.: 30-35 mm. Zdjęcia przedstawiają przykładowe oferowane przez nasz sklep kamienie. Bryłki wybierane są losowo, cena dotyczy pojedynczej sztuki.','','krysztal-gorski---brylka-30---35-mm10','','','','KRYSZTAŁ GÓRSKI - BRYŁKA 30 - 35 mm','','','',''),(1046,1,2,'Girasol 