je się na około 700 000 lat. W przeciwieństwie do europejskiego tektytu – mołdawitu, którego barwa jest zielona, indochinity posiadają ciemną, czarną barwę. Wielkość indochinitów jest różna. Przeważnie są to niewielkich rozmiarów kamienie, chociaż trafiają się również i bardzo duże okazy. Największy indochinit ma masę 29 kg i jest największym znalezionym do tej pory tektytem na świecie.','','indochinit---tektyt-56-mm993','','','','INDOCHINIT - TEKTYT 56 mm','','','',''),(2029,1,2,'Przedmiotem oferty jest naturalny, nieszlifowany indochinito ładnym kształcie i ciekawej fakturze. Okazpochodziz Półwyspu Indochińskiego.Przybliżona wielkość kamienia ok. 57 x 32 x 16 mm.Zdjęcia przedstawiają oferowany idochinit.Indochinitto rodzaj tektytu znajdowanego na terenie Półwyspu Indochińskiego. Tektyty powstają ze stopienia skał podłoża podczas upadu dużych meteorytów. Przetopione w wyniku uderzenia skały zostają wyrzucone w powietrze i rozproszone na znacznym obszarze. Wiek indochinitów szacuje się na około 700 000 lat. W przeciwieństwie do europejskiego tektytu – mołdawitu, którego barwa jest zielona, indochinity posiadają ciemną, czarną barwę. Wielkość indochinitów jest różna. Przeważnie są to niewielkich rozmiarów kamienie, chociaż trafiają się również i bardzo duże okazy. Największy indochinit ma masę 29 kg i jest największym znalezionym do tej pory tektytem na świecie.','','indochinit---tektyt-57-mm994','','','','INDOCHINIT - TEKTYT 57 mm','','','',''),(2030,1,2,'Przedmiotem oferty jest naturalny, nieszlifowany indochinito ładnym kształcie i ciekawej fakturze. Okazpochodziz Półwyspu Indochińskiego.Przybliżona wielkość kamienia ok. 52 x 45 x 18 mm.Zdjęcia przedstawiają oferowany idochinit.Indochinitto rodzaj tektytu znajdowanego na terenie Półwyspu Indochińskiego. Tektyty powstają ze stopienia skał podłoża podczas upadu dużych meteorytów. Przetopione w wyniku uderzenia skały zostają wyrzucone w powietrze i rozproszone na znacznym obszarze. Wiek indochinitów szacuje się na ok